(117, 'about_us_page', '', 3, '_About_us_Title_', 'About Us', 'Über uns ', '2021-11-22 07:03:37.473239'),
(118, 'about_us_page', '', 3, '_super_Driving_instructor_title_', 'Super Driving Instructor For Super Learner Drivers.', 'Deine Fahrschule in Aarau, Baden, Winterthur und Zürich', '2022-01-12 08:55:21.576434'),
(119, 'about_us_page', '', 3, '_Star_driving_School_Title', 'We have set the goal of making driver training possible for everyone, regardless of their financial situation.', 'Wir haben zum Ziel gesetzt jedem, unabhängig von seiner finanziellen Situation, die Fahrausbildung zu ermöglichen. ', '2022-02-01 07:40:41.094167'),
(122, '', '', 3, '_Specialized_Title_', 'that everyone is specialized in their area and very strong, so we guarantee high quality and can continue to offer our students a high standard.', 'Bei den Fahrlehrern und Instruktoren achten wir darauf, dass jeder in seinem Gebiet spezialisiert und sehr stark ist. So gewährleisten wir eine hohe Qualität und können unseren Schülern weiterhin einen hohen Standard bieten.', '2021-09-06 10:27:32.441490'),
(123, '', '', 3, '_Relaxed_Friendly_Title_', 'Thanks to a relaxed, friendly and humorous atmosphere, you can get to your destination quickly with a lot of fun.', 'Durch eine lockere, kollegiale und humorvolle Atmosphäre kommt man bei uns mit viel Spass rasch ans Ziel.', '2021-09-06 10:27:35.499806'),
(124, 'about_us_page', '', 3, 'Our_ Creative _Team_title_', 'Our Creative Team', 'Unser Superteam', '2021-11-15 10:50:15.599056'),
(125, 'about_us_page', '', 3, '_Lorem_ipsum_dolor_Title_', 'The Star driving school only works with selected driving instructors and instructors. With the driving instructors and instructors, we make sure that everyone is specialized in their area and very strong. This is how we ensure high quality and can continue to offer our students a high standard. With a relaxed, collegial and humorous atmosphere, you can quickly reach your goal with a lot of fun and humor.', 'Die Fahrschule Star arbeitet nur mit ausgewählten Fahrlehrern und Instruktoren zusammen. Bei den Fahrlehrern und Instruktoren achten wir darauf, dass jeder in seinem Gebiet spezialisiert und sehr stark ist. So gewährleisten wir eine hohe Qualität und können unseren Schülern weiterhin einen hohen Standard bieten. Durch eine lockere, kollegiale und humorvolle Atmosphäre kommt man bei uns mit viel Spass und Humor rasch ans Ziel. ', '2022-01-28 07:44:22.574569'),
(126, '', '', 3, '_Veniam_Quis_nostrud_Tile_', 'veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit', '', '2021-09-06 10:27:44.957103'),
(127, '', '', 3, '_Cillum_Title_', 'esse cillum. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Sed ut perspiciatis unde', '', '2021-09-06 10:27:49.105566'),
(128, '', '', 3, '_Omnis_Natus_Title_', 'omnis iste natus error sit voluptatem.', '', '2021-09-06 10:28:02.656712'),
(129, 'about_us_page', '', 3, '_Team1_Title_', 'MIGE', 'MIGE', '2022-02-01 06:01:56.451902'),
(130, 'about_us_page', '', 3, '_Team1_description_', 'Mige, Entschuldigung, Captain Mige ist ein waschechter Seeräuber. Er sieht nicht nur aus wie ein Pirat, er spricht auch so. Dies liegt nicht daran, dass er einen Sprachfehler hat, sondern daran, dass er mehrere Sprachen spricht und diese irgendwie ordnen muss.', 'Mige, Entschuldigung, Captain Mige ist ein waschechter Seeräuber. Er sieht nicht nur aus wie ein Pirat, er spricht auch so. Dies liegt nicht daran, dass er einen Sprachfehler hat, sondern daran, dass er mehrere Sprachen spricht und diese irgendwie ordnen muss.', '2022-02-01 06:02:02.672343'),
(131, '', '', 3, '_captain_Mige_Title_', 'behind him, sorry, Captain Mige and likes to hang his trophies on the wall (see Instagram).', '«Mige» Justiniano ist der Aargauer Superfahrlehrer – aber «streng und pingelig».', '2021-09-06 10:34:00.021432'),
(132, 'about_us_page', '', 3, '_Team2_Title_', 'MATEEN', 'MATEEN', '2022-02-03 08:17:27.691640'),
(133, 'about_us_page', '', 3, '_Team2_description_', 'Im Sommer rennt er vielfach im rosaroten Outfit über den Fussballplatz, und im Winter pflegt er seinen Bart, okay, eigentlich macht er das das ganze Jahr. Wenn er nicht gerade im Fitness oder mit Kosmetikprodukten beschäftigt ist, plant er kleine Attentate auf seine Schüler und treibt sie mit Messer und Machete und einer grossen Portion Humor zur Prüfung.', 'Im Sommer rennt er vielfach im rosaroten Outfit über den Fussballplatz, und im Winter pflegt er seinen Bart, okay, eigentlich macht er das das ganze Jahr. Wenn er nicht gerade im Fitness oder mit Kosmetikprodukten beschäftigt ist, plant er kleine Attentate auf seine Schüler und treibt sie mit Messer und Machete und einer grossen Portion Humor zur Prüfung.', '2022-02-03 08:17:27.692127'),
(134, '', '', 3, '_Grizzly_Bear_Title_', 'like a grizzly bear, he is \"only\" a teddy bear. He flexes his muscles in front of the expert and provides quick arguments why his students should pass the exam.', 'Obwohl er aussieht wie ein Grizzly-Bär ist er doch «nur» ein Teddybär. Seine Muskeln lässt er vor dem Experten spielen und bringt schlagfertige Argumente, warum seine Schüler die Prüfung bestehen sollten.', '2021-09-06 10:29:14.929379'),
(135, 'about_us_page', '', 3, '_Team3_Title_', 'BÄROL', 'BÄROL', '2022-02-03 08:17:27.693479'),
(136, 'about_us_page', '', 3, '_Team3_description_', 'Bärol ist unser Bärliner. Was ein Bärliner ist, keine Ahnung, fragt ihn selbst. Mit benebelten Menschen kennt er sich bestens aus, ist es doch er, der mit seiner Shisha die Leute einnebelt. Er sieht soooo böse aus, dass die Experten nie einen seiner Schüler durchfallen lassen würden.', 'Bärol ist unser Bärliner. Was ein Bärliner ist, keine Ahnung, fragt ihn selbst. Mit benebelten Menschen kennt er sich bestens aus, ist es doch er, der mit seiner Shisha die Leute einnebelt. Er sieht soooo böse aus, dass die Experten nie einen seiner Schüler durchfallen lassen würden.', '2022-02-03 08:17:27.693906'),
(137, '', '', 3, '_Motorcycle_Drive_Title_', 'motorcycle through the wild Aargau or quickly drives his students through the test using adventurous examples.', 'reitet er auf seinem Motorrad durch den wilden Aargau oder bringt seine Autofahrschüler anhand abenteuerlicher Beispiele rasch durch die Prüfung.', '2021-09-06 10:34:13.849936'),
(138, 'about_us_page', '', 3, '_Team4_Title_', 'ANDREA', 'ANDREA', '2022-02-03 08:17:27.695281'),
(139, 'about_us_page', '', 3, '_Team4_description_', 'Andrea – der elektrifizierende Fahrlehrer. Nein, Andrea ist keine Frau, diesen Namen gibt es auch für Männer – ja wirklich, wir konnten es auch nicht glauben. Früher war er als Elektriker unterwegs, dies erklärt auch seine «elektrifizierende» Art, bestimmt hat er schon den einen oder anderen Stromschlag zu viel bekommen. Da er etwas zu kurz ist für ein echtes Motorrad, fährt er gerne auf seinem Kinderbike auf Rennstrecken im Kreis, bis er nicht mehr weiss, wo oben und unten ist.', 'Andrea – der elektrifizierende Fahrlehrer. Nein, Andrea ist keine Frau, diesen Namen gibt es auch für Männer – ja wirklich, wir konnten es auch nicht glauben. Früher war er als Elektriker unterwegs, dies erklärt auch seine «elektrifizierende» Art, bestimmt hat er schon den einen oder anderen Stromschlag zu viel bekommen. Da er etwas zu kurz ist für ein echtes Motorrad, fährt er gerne auf seinem Kinderbike auf Rennstrecken im Kreis, bis er nicht mehr weiss, wo oben und unten ist.', '2022-02-03 08:17:27.695800'),
(140, '', '', 3, '_Plans_Small_Attacks_Title_', 'he plans small attacks on his students and drives them with knives and machetes and a large portion of humor for testing.', 'plant er kleine Attentate auf seine Schüler und treibt sie mit Messer und Machete und einer grossen Portion Humor zur Prüfung.', '2021-09-06 10:34:28.295658'),
(141, 'about_us_page', '', 3, '_Team5_Title_', 'NIDI', 'NIDI', '2022-02-03 08:17:27.697151'),
(143, 'about_us_page', '', 3, '_Team5_description_', 'Ja, Nidi ist sein Name. Wie es zu diesem Namen kam, weiss nicht mal er selbst. In seinem alten Beruf hat er etwas zu viel an den Pneus und dem Kleber gerochen, ansonsten können wir es uns nicht erklären, warum er Fahrlehrer werden wollte.', 'Ja, Nidi ist sein Name. Wie es zu diesem Namen kam, weiss nicht mal er selbst. In seinem alten Beruf hat er etwas zu viel an den Pneus und dem Kleber gerochen, ansonsten können wir es uns nicht erklären, warum er Fahrlehrer werden wollte.', '2022-02-03 08:17:27.697605'),
(144, 'about_us_page', '', 3, '_Team6_Title_', 'ANDRIAN', 'ANDRIAN', '2022-02-03 08:17:27.698956'),
(145, 'about_us_page', '', 3, '_Team6_description_', 'Andi, der Auswanderer. Als es für ihn auf den Philippinen keine Herausforderungen mehr gab und er sich unter den Palmen an dem kristallklaren, türkisfarbenen Meer nur noch langweilte, kam er auf die grandiose Idee, in die Schweiz zurückzukehren, um hier zu arbeiten. Ja, wir dachten das Gleiche: Der Gestörte tauscht Paradies gegen, naja, dem Platz neben dir.', 'Andi, der Auswanderer. Als es für ihn auf den Philippinen keine Herausforderungen mehr gab und er sich unter den Palmen an dem kristallklaren, türkisfarbenen Meer nur noch langweilte, kam er auf die grandiose Idee, in die Schweiz zurückzukehren, um hier zu arbeiten. Ja, wir dachten das Gleiche: Der Gestörte tauscht Paradies gegen, naja, dem Platz neben dir.', '2022-02-03 08:17:27.699401'),
(146, 'about_us_page', '', 1, '_Team7_Title_', 'GIANNI', 'GIANNI', '2022-02-03 08:17:27.700777'),
(147, 'about_us_page', '', 1, '_Team7_description_', 'Gianni sieht zwar aus wie ein Grizzlybär, doch eigentlich ist er eher ein Teddybär. Man kann ihn als «menschliche Leinwand» ansehen: Etwas Farbe da, etwas Farbe dort, da kann es schon mal passieren, dass ein paar Farbtupfer im Gesicht landen. Wenn du die Prüfung beim ersten Mal bestehst, darfst du bestimmt auch noch etwas Farbe anbringen.', 'Gianni sieht zwar aus wie ein Grizzlybär, doch eigentlich ist er eher ein Teddybär. Man kann ihn als «menschliche Leinwand» ansehen: Etwas Farbe da, etwas Farbe dort, da kann es schon mal passieren, dass ein paar Farbtupfer im Gesicht landen. Wenn du die Prüfung beim ersten Mal bestehst, darfst du bestimmt auch noch etwas Farbe anbringen.', '2022-02-03 08:17:27.701223'),
(148, 'about_us_page', '', 1, '_Team8_Title_', 'FRANKY', 'FRANKY', '2022-02-03 08:17:27.702819'),
(149, 'about_us_page', '', 1, '_Team8_description_', 'Frankydundee lebte einige Zeit im Busch, und wenn er nicht gerade von Schlangen gebissen oder von Krokodilen gejagt wird, reitet er auf seinem Motorrad durch den wilden Aargau oder bringt seine Autofahrschüler anhand abenteuerlicher Beispiele rasch durch die Prüfung.', 'Frankydundee lebte einige Zeit im Busch, und wenn er nicht gerade von Schlangen gebissen oder von Krokodilen gejagt wird, reitet er auf seinem Motorrad durch den wilden Aargau oder bringt seine Autofahrschüler anhand abenteuerlicher Beispiele rasch durch die Prüfung.', '2022-02-03 08:17:27.703303'),
(150, 'about_us_page', '', 1, '_Team9_Title_', 'MICHAEL', 'MICHAEL', '2022-02-03 08:17:27.704648'),
(151, 'about_us_page', '', 1, '_Team9_description_', 'Sie wollten ihn nicht mehr in Deutschland, da kam er halt in die Schweiz. Wenn es für das Deutschsein im Duden ein Foto gäbe, wäre es bestimmt Michaels Porträt. Korrekt, pünktlich, genau – wie wir Schweizer es mögen. Doch wie sagt man noch so schön: Der Weg ist das Ziel.', 'Sie wollten ihn nicht mehr in Deutschland, da kam er halt in die Schweiz. Wenn es für das Deutschsein im Duden ein Foto gäbe, wäre es bestimmt Michaels Porträt. Korrekt, pünktlich, genau – wie wir Schweizer es mögen. Doch wie sagt man noch so schön: Der Weg ist das Ziel.', '2022-02-03 08:17:27.705080'),
