(228, '', '', 1, '_einem_ Roller _/_ Motorrad _mit_Title_ ', '12 Stunden ab 18 Jahren Die Kursteilnahme ist nur mit einem gültigen Lernfahrausweis Kategorie A 35kW und einem Roller / Motorrad mit höchstens 35kW Leistung möglich!*', '12 Stunden ab 18 Jahren. Die Kursteilnahme ist nur mit einem gültigen Lernfahrausweis der Kategorie A 35 kW und einem Roller/Motorrad mit höchstens 35 kW Leistung möglich.*', '0000-00-00 00:00:00.000000'),
(229, '', '', 1, '_Aoffen_Title_', 'A (Open)', 'A (offen)', '0000-00-00 00:00:00.000000'),
(230, '', '', 1, '_category_ A _learning _driving _license_Title_', '12 hours from the age of 25 The course can only be attended with a valid category A learning driving license and a scooter / motorcycle with more than 11 kW power!*', '12 Stunden ab 25 Jahren. Die Kursteilnahme ist nur mit einem gültigen Lernfahrausweis der Kategorie A und einem Roller/Motorrad mit mehr als 11 kW Leistung möglich.*', '0000-00-00 00:00:00.000000'),
(231, '', '', 1, '_A1_From _18 _Years_title_', 'A1 - From 18 Years', 'A1 (ab 18 Jahren)', '0000-00-00 00:00:00.000000'),
(232, '', '', 1, '_Particpation_in_the_course_title_', 'Participation in the course is only possible with a valid category A1 learning driving license and a scooter / motorcycle with a maximum of 125 cm3 and 11 kW power!*', 'Die Kursteilnahme ist nur mit einem gültigen Lernfahrausweis der Kategorie A1 und einem Roller/Motorrad mit höchstens 50 cm3 möglich!*', '0000-00-00 00:00:00.000000'),
(233, '', '', 1, 'A1_ From_16 _Years_title_', 'A1 - From 16 Years', 'A1 (ab 16 Jahren)', '0000-00-00 00:00:00.000000'),
(234, '', '', 1, '_scooter_motorcycle _with_ a_ maximum_Title_', 'Participation in the course is only possible with a valid category A1 learning driving license and a scooter / motorcycle with a maximum of 50 cm3!*', 'Die Kursteilnahme ist nur mit einem gültigen Lernfahrausweis der Kategorie A1 und einem Roller/Motorrad mit höchstens 125 cm3 und 11 kW Leistung möglich.*', '0000-00-00 00:00:00.000000'),
(235, '', '', 1, '_back_title_', 'back', 'Zurück', '0000-00-00 00:00:00.000000'),
(236, '', '', 1, '_continue_Title_', 'continue', 'Weiter', '0000-00-00 00:00:00.000000'),
(237, 'moto_page', '', 7, '_Motorycle_ Aarau_Title_', 'Motorcycle course for the Aarau, Baden and Zurich region ', 'Motorradkurs für die Region Aarau, Baden und Zürich', '2021-12-17 07:43:25.679155'),
(238, '', '', 7, '_star_Driving_Title_', 'The Star driving school has established itself in the basic motorcycle course area for the regions of Aarau, Baden and Zurich and is the point of contact for an entertaining and interesting course. The courses are structured close to the exam and structured in an instructive manner. With a lot of fun and humor, the hours fly by.', 'Die Fahrschule Star hat sich im Bereich Motorradgrundkurs für die Regionen Aarau, Baden und Zürich etabliert und ist die Anlaufstelle für einen unterhaltsamen und interessanten Kurs. Die Kurse sind prüfungsnah aufgebaut und lehrreich gegliedert. Mit viel Spass und Humor vergehen die Stunden wie im Flug.', '2021-09-07 04:40:26.762180'),
(239, '', '', 7, '_Underestimate_Title_', 'Many underestimate the very high level that is required for the exam in Switzerland. The diarrhea rate last year was a whopping 56% !!', 'Viele unterschätzen das sehr hohe Niveau, welches in der Schweiz an der Prüfung gefragt ist. Im vergangenen Jahr betrug die Durchfallsquote sagenhafte 56 %!', '0000-00-00 00:00:00.000000'),
(240, '', '', 7, '_ practice_ the _course_ goals_Title_', 'We have set up our basic motorcycle course in such a way that practically no driving lessons are required (provided you reach and practice the course goals). A test drive lesson gives a feeling of what it will be like during the test and serves as a location assessment.', 'Wir haben unseren Motorradgrundkurs so aufgebaut, dass man praktisch keine Fahrstunden mehr benötigt (sofern man die Kursziele erreicht und übt). Eine Prüfungsfahrtlektion gibt ein Gefühl, wie es an der Prüfung sein wird, und dient als Standortbestimmung.', '0000-00-00 00:00:00.000000'),
(241, 'moto_page', '', 7, '_Motorbike_trial_course_title_', 'Motorbike trial course', 'Motorrad-Schnupperkurs', '2021-12-08 07:15:13.195454'),
(242, '', '', 7, '_mptprcycling_title_', 'Motorcycling is not just a way to get around, it is passion and embodies a feeling of freedom.', 'Motorradfahren ist nicht nur eine Art, um sich fortzubewegen, es ist Leidenschaft und verkörpert ein Gefühl von Freiheit.', '0000-00-00 00:00:00.000000'),
(243, '', '', 7, '_ability _to_ move_title_', 'In this course we show you the first steps and impart the necessary know-how and the ability to move a motorcycle.', 'In diesem Kurs zeigen wir dir die ersten Schritte und vermitteln das nötige Know-how und die Fähigkeit, ein Motorrad zu bewegen.', '2021-09-06 18:26:38.848396'),
(244, '', '', 7, '_Combine_Theory_Title_', 'With a lot of humor we combine theory with practice in such a way that you would like to keep going all day long.', 'Mit viel Humor kombinieren wir die Theorie mit der Praxis so, dass du am liebsten noch den ganzen Tag weitermachen möchtest.', '0000-00-00 00:00:00.000000'),
(245, 'moto_page', '', 7, '_Basic_motorcycle_Title_', 'Basic Motorcycle Courses', 'Motorrad-Grundkurse', '2021-12-08 07:15:13.198090'),
(246, 'moto_page', '', 7, '_Motorcycle_Training_Title_', 'Motorcycle Curve Training ', 'Motorrad-Kurventraining', '2021-12-27 08:21:58.151599'),
(247, '', '', 7, '_Cornering_Right_Tehcnology_title_', 'Cornering is the most beautiful thing about motorcycling. With the right technology, safety, fun and joy increase. We practice that on this daily course. We learn to consciously', 'Kurvenfahren ist das Schönste beim Motorradfahren. Mit der richtigen Technik erhöht sich die Sicherheit, der Spass und die Freude. Das üben wir an diesem Tageskurs. Wir lehren, die Kurven bewusst zu realisieren und diese auf einer sicheren Linie zu durchfahren. Ziel ist, Kurven möglichst rund und dynamisch zu fahren.', '0000-00-00 00:00:00.000000'),
(248, '', '', 7, '_implement_curves_drive_Title_', 'implement the curves and to drive them on a safe line. The goal is to make curves as round and dynamic as possible.', 'Mit Hightech und Know-how zeigen wir dir auf, wie schön Kurvenfahren sein kann.', '0000-00-00 00:00:00.000000'),
(249, '', '', 7, '_high_tech_and_know_how_ttile_', 'With high-tech and know-how, we show you how beautiful cornering can be.', 'Mit Hightech und Know-how zeigen wir Ihnen, wie schön...', '2021-10-08 06:23:57.455175'),
