(254, 'moto_page', '', 7, '_Motorcycle_gloves_Title_', 'Motorcycle gloves or gloves made from abrasion and tear-resistant material', 'Motorradhandschuhe oder Handschuhe aus abrieb- und reissfestem Material', '2021-11-20 19:12:39.445901'),
(255, 'moto_page', '', 7, '_robist_Jacket_trousers_title_', 'Robust jacket and trousers made of abrasion and tear resistant material', 'Robuste Jacke und Hose aus abrieb- und reissfestem Material', '2021-11-20 19:12:39.447139'),
(256, 'moto_page', '', 7, '_Motorbike_boots_ankle_title_', 'Motorbike boots or ankle-protecting, sturdy shoes', 'Motorradstiefel oder knöchelschützendes, festes Schuhwerk', '2021-11-20 19:12:39.448374'),
(257, '', '', 7, '_Protective_requirement_title_', 'The protective requirements for clothing must also be met when wearing rainwear.', 'Die Schutzanforderungen an die Bekleidung müssen auch beim Tragen der Regenbekleidung erfüllt sein.', '0000-00-00 00:00:00.000000'),
(258, 'moto_page', '', 7, '_Category_A_A_Limited_Title_', 'Category A And A Limited (35KW)', 'Kategorie A und A beschränkt (35 kW)', '2021-12-08 07:16:53.083481'),
(259, '', '', 7, '_Moto_gloves_title_', 'Motorcycle gloves', 'Motorradhandschuhe', '0000-00-00 00:00:00.000000'),
(260, 'moto_page', '', 7, '_jacket_title_', 'Motorcycle jacket', 'Motorradjacke', '2021-11-20 19:12:39.454193'),
(261, 'moto_page', '', 7, '_pants_title_', 'Motorcycle pants', 'Motorradhose', '2021-11-20 19:12:39.455372'),
(262, 'moto_page', '', 7, '_Vehicle_cat_title_', 'Vehicle Cat. A', 'Kategorie A', '2022-03-03 05:17:56.886455'),
(263, 'moto_page', '', 7, 'A-2_wheeled_title_', 'A 2-wheeled, 2-seater motorcycle without a sidecar with an engine power of at most 35 kW and a ratio of engine power and unladen weight of not more than 0.20 kW / kg. No motorcycle in subcategory A1.', 'Ein Motorrad ohne Seitenwagen mit einer Motorleistung von mindestens 35 kW, zwei Sitzplätzen und einem Verhältnis von Motorleistung und Leergewicht von mehr als 0,20 kW/kg.', '2021-12-04 22:46:43.078773'),
(264, 'moto_page', '', 7, '_vehicle_category_A1_title_', 'Vehicle Category A1', 'Kategorie A1', '2022-03-30 18:44:28.936402'),
(265, 'moto_page', '', 7, '_two_wheel_motorcycle_title_', 'A two-wheel motorcycle without a sidecar with a maximum displacement of 125 cm3 and an engine output of maximum 11 kW. (For handlebars 18 years at most 50 cm3). ', 'Ein zweirädriges Motorrad ohne Seitenwagen mit einem Hubraum von höchstens 125 cm3 und einer Motorleistung von höchstens 11 kW. Für Lenker unter 16 Jahren höchstens 50 cm3 und max. 4 kW. Nach vollendetem 16. Lebensjahr ist man automatisch dazu berechtigt, ein Motorrad mit einem Hubraum von max. 125 cm3 und max. 11 kW zu führen.', '2021-11-20 19:12:39.465690'),
(266, '', '', 7, '_vehicle_maximum_speed_title_', 'If a test vehicle with a maximum speed of 45 km / h is used, the category A1 is limited to 45 km / h.', '', '0000-00-00 00:00:00.000000'),
(267, '', '', 7, '_ehicle_cat_title_', 'ehicle Cat. A', 'Fahrzeug Kat. A', '0000-00-00 00:00:00.000000'),
(268, 'moto_page', '', 7, '_motorcycle_sidecar_title_', 'A motorcycle without a sidecar with an engine output of at least 35 kW and two seats.', 'Ein zweirädriges, zweiplätziges Motorrad ohne Seitenwagen mit einer Motorleistung von höchstens 35 kW und einem Verhältnis von Motorleistung und Leergewicht von nicht mehr als 0,20 kW/kg. Kein Motorrad der Unterkategorie A1.', '2021-12-04 22:49:12.393993'),
(269, 'moto_page', '', 7, '_Rent_motorcycle_title_', 'Rent A Motorcycle?', 'Motorrad mieten?', '2021-11-20 19:12:39.466962'),
(270, '', '', 7, '_own_motorcycle_yet_title_', 'You don\'t have your own motorcycle yet? Would you like to rent one for the course or even buy one later? Get in touch with our partner Hauptlin . He will provide a suitable motorcycle.', 'Du besitzt noch kein eigenes Motorrad? Du möchtest für den Kurs eines mieten oder später sogar eines kaufen? Melde dich bei unserem Partner Hauptlin [link to https://www.hauptlin.ch/de/index.html]. Er wird dir ein passendes Motorrad bereitstellen.', '0000-00-00 00:00:00.000000'),
(271, '', '', 7, '_reservation_request_title_', 'For a reservation request, please contact Hauptlin directly: info@hauptlin.ch If you definitely decide to rent a motorcycle, you declare that you agree to the General Terms and Conditions of Hauptlin.', 'Für eine Reservationsanfrage direkt an Hauptlin wenden: info@hauptlin.ch [mail to info@hauptlin.ch] \r\nWenn du dich definitiv entscheidest, ein Motorrad zu mieten, erklärst du dich mit den AGB [link to https://cdn.fahrschule-star.ch/wp-content/uploads/2018/01/Allgemeine-Vertragsbestimmungen-Miete-Fahrzeug.pdf -> tbd] von Hauptlin einverstanden.', '0000-00-00 00:00:00.000000'),
(272, 'moto_page', '', 7, '_boo_motorcycle_course_title_', 'Book A Motorcycle Course Now!', 'Jetzt Termine für den Motorradgrundkurs buchen', '2021-11-20 19:12:39.469433'),
(273, 'moto_page', '', 7, '_esaily_book_motorcycle_course_title_', 'You can easily book the motorcycle course of your choice online.', 'Buche deine Termine für den Motorradgrundkurs bequem online.', '2021-11-20 19:12:39.470656'),
(274, 'price', '', 8, '_Pricing_Plan_title_', 'Pricing plan', 'Preise', '2021-12-14 11:19:08.419452'),
(276, 'price', '', 8, '_pay_comfortably_title_', 'Pay Comfortably In Installments For All Driving Hours ', 'Alle Fahrstunden bequem in Raten bezahlen', '2021-12-08 08:12:08.250911'),
(277, 'price', '', 8, '_ almost_mandatory_title_', 'In today\'s era of mobility, it is almost mandatory to take the car test. On the way to acquiring the driver\'s license you have to overcome a few hurdles such as the financial investment for driving lessons, theory testing, traffic studies and driving courses.\r\nThe financial situation poses problems for many young people. The professional and private pressure to pass the exam as quickly as possible and the lack of financial resources are a major obstacle. Studies have shown that, on average, you need a few hours more driving if you attend the driving school at irregular intervals.\r\n\r\nWe offer a fair and customer-oriented solution to this problem - purchase on installments.\r\n\r\nRequest driving lessons online and step on the gas. We will help you to pass the exam as soon as possible. You can only concentrate on driving and don\'t have to worry about the financial means. We shoot you the money and you pay back the amount comfortably in installments (up to 12 months). You do NOT have to sign a contract or anything like that.The only thing you have to do is choose a package online, add it to the shopping cart, select installment purchase, register and you\'re done. (positive credit check required)\r\n\r\nThe lesson prices for paying in installments for the machine and the manually switched car are CHF 89 .- / lesson and in a 10-person subscription CHF 890.-', 'In der heutigen Zeit der Mobilität ist es beinahe Pflicht, die Autoprüfung abzulegen. Auf dem Weg zum Erwerb des Führerausweises muss man aber einige Hürden bewältigen wie die finanzielle Investition in Fahrstunden, Theorieprüfung, Verkehrskunde und Fahrkurse.', '2021-11-17 08:04:42.981496'),
(278, 'price', '', 8, '_financial_situation_title_', 'The financial situation poses problems for many young people. The professional and private pressure to pass the exam as quickly as possible and the lack of financial resources are a major obstacle. Studies have shown that, on average, you need a few hours more driving if you attend the driving school at irregular intervals.', 'the lack of financial resources are a major obstacle. Studies have shown that, on average, you need a few hours more driving if you attend the driving school at irregular intervals.the lack of financial resources are a major obstacle. Studies have shown that, on average, you need a few hours more driving if you attend the driving school at irregular intervals.', '2021-11-11 06:17:48.404219'),
(279, 'price', '', 8, '_offer_fair_title_', 'We offer a fair and customer-oriented solution to this problem - purchase on installments.', 'Wir bieten für diese Problematik eine faire und kundenorientierte Lösung: den Kauf auf Raten. ', '2021-11-11 06:17:48.404219'),
(280, 'price', '', 8, 'Request_driving_lessons_online_title_ ', 'Request driving lessons online and step on the gas. We will help you to pass the exam as soon as possible. You can only concentrate on driving and don\'t have to worry about the financial means. We shoot you the money and you pay back the amount comfortably in installments (up to 12 months). You do NOT have to sign a contract or anything like that.The only thing you have to do is choose a package online, add it to the shopping cart, select installment purchase, register and you\'re done. (positive credit check required)', 'Buche online Fahrstunden und gib Gas. Wir helfen dir, so rasch wie möglich die Prüfung zu bestehen. Dabei kannst du dich nur auf das Fahren konzentrieren und brauchst dir keine Sorgen um die finanziellen Mittel zu machen. Wir schiessen dir das Geld vor, und du bezahlst bequem in Raten (innerhalb zwölf Monaten) den Betrag zurück. Dabei musst du keinen Vertrag oder derartiges unterzeichnen. Das Einzige, was du tun musst, ist online ein Paket wählen, in den Warenkorb legen, Ratenkauf anwählen, anmelden und fertig (positive Bonitätsprüfung wird vorausgesetzt).', '2021-11-11 06:17:48.404219'),
(281, 'price', '', 8, '_Lesson_prices_title_', 'The lesson prices for paying in installments for the machine and the manually switched car are CHF 89 .- / lesson and in a 10-person subscription CHF 890.-', 'Die Lektionspreise für die Ratenzahloption betragen für die Autofahrausbildung (Schaltung oder Automat) CHF 89.– pro Lektion und im 10er-Abo CHF 890.–.', '2021-11-11 06:17:48.404219'),
