(377, '', '', 7, '_protective_requirements_for_title_', 'The protective requirements for clothing must also be met when wearing rainwear', 'Auch beim Tragen von Regenbekleidung sind die Schutzanforderungen an die Kleidung einzuhalten', '0000-00-00 00:00:00.000000'),
(378, 'price', '', 8, '_Traffic_in_the_Baden_title_', 'Traffic in the Baden region is like sand at the sea. To spice up this dry lesson so that you can get the course behind you with a lot of fun in a short time, we have hired a specialist who is a real ace in the field of VKU. ', 'Verkehrskunde (VKU) in der Region Baden und Winterthur gibt es wie Sand am Meer. Um diesen trockenen Unterricht etwas aufzupeppen, haben wir unsere Theorielokale so eingerichtet, dass du dich wie zu Hause fühlst, und den Unterricht so kurzweilig wie möglich gestaltet. Ja, es bleibt bei CHF 140.-. Es fallen keine zusätzlichen Kosten an. ', '2022-03-10 11:43:04.856563'),
(379, 'price', '', 8, 'drive_today_pay_title_', 'Drive today - pay tomorrow', 'Heute fahren - morgen bezahlen', '2021-12-08 08:12:08.249365'),
(380, 'price', '', 8, '_we_ooffer_first_title_', 'We offer the first aid course (NHK) in the Baden region at an affordable price. For only 69.- (including ID) you learn first aid, which is mandatory for the acquisition of a driver\'s license ', 'Den Nothelferkurs (NHK) bieten wir in der Region Baden und Winterthur zu einem günstigen Preis an. Für nur CHF 69.– (inklusive Ausweis) erlernt man die Erste Hilfe, welche für den Erwerb eines Führerausweises obligatorisch ist', '2022-03-10 11:41:21.320905'),
