(483, 'Vku_page', '', 0, 'Vku_page_desc', 'Traffic in the Baden region is like sand at the sea. To spice up this dry lesson so that you can get the course behind you with a lot of fun in a short time, we have hired a specialist who is a real ace in the field of VKU. \r\n The compulsory traffic science lessons (VKU) consist of 4 double lessons and can be attended to accompany the practical driving lessons. However,  Traffic customer lessons (VKU) may only be attended with a valid learning driving license!  For legal reasons, the double lessons must take place on four different days.\r\n Register now and benefit from our cheap course offers.', 'Verkehrskunde in der Region Baden gibt es wie Sand am Meer. Um diesen trockenen Unterricht etwas aufzupeppen, damit du den Kurs mit viel Spass in kurzer Zeit hinter dich bringen kannst, haben wir extra einen Spezialisten engagiert, welcher im Bereich VKU ein richtiges Ass ist.\r\n\r\nDer obligatorische Verkehrskundeunterricht (VKU) besteht aus vier Doppellektionen und kann begleitend zum praktischen Fahrunterricht besucht werden. Es empfiehlt sich jedoch, den VKU möglichst früh zu besuchen, damit wichtige Informationen bei der praktischen Fahrausbildung angewendet werden können.\r\n\r\nDer VKU darf nur mit einem gültigen Lernfahrausweis besucht werden.\r\n\r\nDie Doppellektionen müssen aus gesetzlichen Gründen an vier verschiedenen Tagen stattfinden. Melde dich gleich an und profitiere von unseren günstigen Kursangeboten.', '2021-12-07 12:52:44.499539'),
(484, 'first_aid_page', '', 0, '_First_Aid_Page_Title_', 'First Aid ', 'Erste-Hilfe', '2021-12-16 12:16:48.530128'),
(485, 'first_aid_page', '', 0, '_First_Aid_Page_banner_desc', 'We offer the emergency helper course (NHK) in the Baden region at a reasonable price. For only CHF 60.– (including ID) you can learn first aid, which is mandatory for obtaining a driver\'s license. <br>\r\nA study has shown that over 80% of the population is unable to provide correct first aid! Do you know how the side position works and when to use it? Or could you use the vital chest compressions? <br>\r\nThe emergency helper course is also a prerequisite for applying for a learner\'s license.', 'Den Nothelferkurs (NHK) bieten wir in der Region Baden zu einem günstigen Preis an. Für nur CHF 60.– (inklusive Ausweis) erlernt man die erste Hilfe, welche für den Erwerb eines Führerausweises obligatorisch ist.\r\nEine Studie hat gezeigt, dass über 80 % der Bevölkerung nicht in der Lage ist, korrekte Erste Hilfe zu leisten! Weisst du, wie die Seitenlage funktioniert und wann diese angewendet wird? Oder könntest du die lebenswichtige Herzdruckmassage anwenden?\r\nDer Nothelferkurs ist zudem Voraussetzung, um einen Lernfahrausweis beantragen zu können.', '2021-12-23 06:23:44.302467'),
(486, 'first_aid_page1', '', 0, '_First_Aid_Page_video_desc', '', '', '2021-12-10 12:55:23.377089'),
(487, 'about_us_page', '', 0, '_Team11_Title_', 'FRO', 'FRO', '2022-02-03 08:17:27.708228'),
(488, 'about_us_page', '', 0, '_Team10_description_', 'Roman, der Motorradrennfahrer. Roman hat eigentlich alles falsch gemacht. Anstatt eine Karriere als Rennfahrer (im Gegensatz zu Andrea mit einem richtigen Motorrad) zu starten, auf alle Gesetze zu pfeifen und so Motorrad zu fahren, wie man es nicht sollte/darf, wird er Fahrlehrer. Nun lehrt er den Leuten die langweilige Art des Fahrens. Naja, willst du es ihm sagen, oder soll ich?', 'Roman, der Motorradrennfahrer. Roman hat eigentlich alles falsch gemacht. Anstatt eine Karriere als Rennfahrer (im Gegensatz zu Andrea mit einem richtigen Motorrad) zu starten, auf alle Gesetze zu pfeifen und so Motorrad zu fahren, wie man es nicht sollte/darf, wird er Fahrlehrer. Nun lehrt er den Leuten die langweilige Art des Fahrens. Naja, willst du es ihm sagen, oder soll ich?', '2022-02-03 08:17:27.706852'),
(489, 'about_us_page', '', 0, '_Team11_description_', 'Fro, Furkan, ja wie denn nun?! Ach komm ... «Der Türke» war im früheren Leben Fitnessinstruktor. Jetzt nervt er hier rum und verkauft uns Proteinshakes und gesunde Sachen. Ich weiss nicht, was der will, aber das passt nicht zum Fahrlehrersein – wir sind faul und dick.', 'Fro, Furkan, ja wie denn nun?! Ach komm ... «Der Türke» war im früheren Leben Fitnessinstruktor. Jetzt nervt er hier rum und verkauft uns Proteinshakes und gesunde Sachen. Ich weiss nicht, was der will, aber das passt nicht zum Fahrlehrersein – wir sind faul und dick.', '2022-02-03 08:17:27.708680'),
