(499, 'price', '', 0, 'pricing_plan_desc', '                                                    In today\'s era of mobility, it is almost mandatory to take the car test. On the way to acquiring the driver\'s license, you have to overcome a few hurdles such as the financial investment for driving lessons, theory testing, traffic studies and driving courses. The financial situation poses problems for many young people. The professional and private pressure to pass the exam as quickly as possible and the lack of financial resources are major obstacles. Studies have shown that, on average, you need a few hours more driving if you attend the driving school at irregular intervals. We offer a fair and customer-oriented solution to this problem - purchase on installments. Request driving lessons online and step on the gas. We will help you to pass the exam as soon as possible. You can only concentrate on driving and don\'t have to worry about the financial means. We shoot you the money and you pay back the amount comfortably in installments (up to 12 months). You do NOT have to sign a contract or anything like that.The only thing you have to do is choose a package online, add it to the shopping cart, select installment purchase, register and you\'re done. (positive credit check required) The lesson prices for paying in installments for the machine and the manually switched car are CHF 89 .- / lesson and in a 10-person subscription CHF 890.-\r\nThe financial situation poses problems for many young people. The professional and private pressure to pass the exam as quickly as possible and the lack of financial resources are a major obstacle. Studies have shown that, on average, you need a few hours more driving if you attend the driving school at irregular intervals.                                                  ', '                                                    In der heutigen Zeit der Mobilität ist es beinahe Pflicht, die Autoprüfung abzulegen. Auf dem Weg zum Erwerb des Führerausweises muss man aber einige Hürden bewältigen wie die finanzielle Investition in Fahrstunden, Theorieprüfung, Verkehrskunde und Fahrkurse. Die finanzielle Situation stellt viele junge Menschen vor Probleme. Der berufliche und private Druck, die Prüfung so schnell wie möglich zu bestehen, und die fehlenden finanziellen Mittel sind ein grosses Hindernis. Studien haben ergeben, dass man im Durchschnitt einige Fahrstunden mehr benötigt, wenn man in unregelmässigen Abständen die Fahrschule besucht. Wir bieten für diese Problematik eine faire und kundenorientierte Lösung: den Kauf auf Raten. Buche online Fahrstunden und gib Gas. Wir helfen dir, die Prüfung so rasch wie möglich zu bestehen. Dabei kannst du dich nur auf das Fahren konzentrieren und brauchst dir keine Sorgen um die finanziellen Mittel zu machen. Wir schiessen dir das Geld vor, und du bezahlst bequem in Raten (innerhalb zwölf Monaten) den Betrag zurück. Dabei musst du keinen Vertrag oder derartiges unterzeichnen. Das Einzige, was du tun musst, ist online ein Paket wählen, in den Warenkorb legen, Ratenkauf anwählen, anmelden und fertig (positive Bonitätsprüfung wird vorausgesetzt). Die Lektionspreise für die Ratenzahloption betragen für die Autofahrausbildung (Schaltung oder Automat) CHF 89.– pro Lektion und im 10er-Abo CHF 890.–.                                                  ', '2021-12-08 13:40:13.235271'),
