(523, 'moto_page', '', 0, '_Moto_Title_Page', 'MOTO', 'Motorrad', '2021-11-20 19:12:39.420350'),
(524, 'moto_page', '', 0, 'Moto_shot_above_desc', '                                                    The Star driving school has established itself in the basic motorcycle course area for the regions of Aarau, Baden and Zurich and is the point of contact for an entertaining and interesting course. The courses are structured close to the exam and structured in an instructive manner. With a lot of fun and humor, the hours fly by.                                                  ', '                                                    Die Fahrschule Star hat sich im Bereich Motorradgrundkurs für die Regionen Aarau, Baden und Zürich etabliert und ist die Anlaufstelle für einen unterhaltsamen und interessanten Kurs. Die Kurse sind prüfungsnah aufgebaut und lehrreich gegliedert. Mit viel Spass und Humor vergehen die Stunden wie im Flug. Viele unterschätzen das sehr hohe Niveau, welches in der Schweiz an der Prüfung gefragt ist. Im vergangenen Jahr betrug die Durchfallsquote sagenhafte 56 %! Wir haben unseren Motorradgrundkurs so aufgebaut, dass man praktisch keine Fahrstunden mehr benötigt (sofern man die Kursziele erreicht und übt). Eine Prüfungsfahrtlektion gibt ein Gefühl, wie es an der Prüfung sein wird, und dient als Standortbestimmung.                                                  ', '2021-11-20 19:12:39.424698'),
(525, 'moto_page', '', 0, 'moto_plan_desc_1', 'Motorcycling is not just a way to get around, it is passion and embodies a feeling of freedom.In this course we show you the first steps and impart the necessary know-how and the ability to move a motorcycle.With a lot of humor we combine theory with practice in such a way that you would like to keep going all day long.', 'Motorradfahren ist nicht nur eine Art, um sich fortzubewegen, es ist Leidenschaft und verkörpert ein Gefühl von Freiheit. In diesem Kurs zeigen wir dir die ersten Schritte und vermitteln das nötige Know-how und die Fähigkeit, ein Motorrad zu bewegen. Mit viel Humor kombinieren wir die Theorie mit der Praxis so, dass du am liebsten noch den ganzen Tag weitermachen möchtest.', '2021-11-20 19:12:39.429051'),
(526, 'moto_page', '', 0, 'moto_plan_desc_2', 'In categories A1 and A, you must complete the practical basic course within four months of the date of issue of the learning driving license. It is 8 hours for category A1 and 12 hours for category A.With a category A learning driving license, you may not complete the basic training with a category A1 vehicle.', 'Bei den Kategorien A1 und A beschränkt ist innerhalb von vier Monaten ab Ausstellungsdatum des Lernfahrausweises der praktische Grundkurs zu absolvieren. Es sind seit dem 1. Januar 2021 für alle Kategorien zwölf Stunden in jeweils drei Teilen à vier Stunden zu besuchen. Danach verlängert sich die Gültigkeit des Lernfahrausweises automatisch um ein Jahr. Der Grundkurs läuft nicht mehr aus, sondern bleibt ein Leben lang gültig. Leider ist aber ein Direkteinstieg in die Kategorie A nicht mehr möglich. Mit einem Lernfahrausweis der Kategorie A beschränkt darf man die Grundschulung nicht mit einem Fahrzeug der Kategorie A1 absolvieren.', '2021-11-20 19:12:39.433263'),
(527, 'moto_page', '', 0, 'moto_plan_desc_3', 'Cornering is the most beautiful thing about motorcycling. With the right technology, safety, fun and joy increase. We practice that on this daily course. We learn to consciouslyWith high-tech and know-how, we show you how beautiful cornering can be.', 'Kurvenfahren ist das Schönste beim Motorradfahren. Mit der richtigen Technik erhöht sich die Sicherheit, der Spass und die Freude. Das üben wir an diesem Tageskurs. Wir lehren, die Kurven bewusst zu realisieren und diese auf einer sicheren Linie zu durchfahren. Ziel ist, Kurven möglichst rund und dynamisch zu fahren. Mit Hightech und Know-how zeigen wir dir, wie schön Kurvenfahren sein kann.', '2021-12-04 21:55:54.099814'),
(528, 'moto_page', '', 0, '_Moto_Title_Categoty', 'MOTO', 'Motorrad', '2021-12-08 07:16:53.091581'),
(529, 'moto_page', '', 0, 'clothing_category_desc_1', 'The protective requirements for clothing must also be met when wearing rainwear.', 'Die Schutzanforderungen an die Bekleidung müssen auch beim Tragen der Regenbekleidung erfüllt sein', '2021-12-04 22:39:00.790628'),
(530, 'moto_page', '', 0, 'clothing_category_desc_2', 'The protective requirements for clothing must also be met when wearing rainwear.', 'Die Schutzanforderungen an die Bekleidung müssen auch beim Tragen der Regenbekleidung erfüllt sein', '2021-12-04 22:39:00.799301'),
(531, 'moto_page', '', 0, '_Motorcycle_helmet_Title_2', 'Motorcycle helmet (tested according to ECE regulation 22)', 'Motorradhelm (geprüft nach ECE-Reglement 22)', '2021-11-20 19:12:39.451911'),
(532, 'moto_page', '', 0, '_Motorcycle_gloves_Title_2', 'Motorcycle gloves or gloves made from abrasion and tear-resistant material', 'Motorradhandschuhe oder Handschuhe aus abrieb- und reissfestem Material', '2021-11-20 19:12:39.453048'),
(533, 'moto_page', '', 0, '_Motorbike_boots_ankle_title_2', 'Motorbike boots or ankle-protecting, sturdy shoes', 'Motorradstiefel oder knöchelschützendes, festes Schuhwerk', '2021-11-20 19:12:39.456520'),
(534, 'moto_page', '', 0, 'Rent_Motorcycle_desc', 'You don\'t have your own motorcycle yet? Would you like to rent one for the course or even buy one later? Get in touch with our partner Hauptlin . He will provide a suitable motorcycle. For a reservation request, please contact Hauptlin directly: info@hauptlin.ch If you definitely decide to rent a motorcycle, you declare that you agree to the General Terms and Conditions of Hauptlin.', 'Du besitzt noch kein eigenes Motorrad? Du möchtest für den Kurs eines mieten oder später sogar eines kaufen? Melde dich bei unserem Partner Hauptlin [link to https://www.hauptlin.ch/de/index.html]. Er wird dir ein passendes Motorrad bereitstellen. Für eine Reservationsanfrage direkt an Hauptlin wenden: info@hauptlin.ch [mail to info@hauptlin.ch] Wenn du dich definitiv entscheidest, ein Motorrad zu mieten, erklärst du dich mit den AGB [link to https://cdn.fahrschule-star.ch/wp-content/uploads/2018/01/Allgemeine-Vertragsbestimmungen-Miete-Fahrzeug.pdf -> tbd] von Hauptlin einverstanden.', '2021-12-04 22:42:17.292337'),
