(593, 'first_aid_page', '', 0, 'First_Aid_Page_file_upload', 'We offer the first aid course (NHK) in the Baden region at an affordable price. For only 60.- (including ID) you learn first aid, which is mandatory for the acquisition of a driver\'s license. \r\n', 'Wir verwenden Ihre personenbezogenen Daten, um die bestmögliche Benutzererfahrung auf dieser Website zu ermöglichen, den Zugriff auf Ihr Konto zu verwalten und für andere Zwecke, die in unserer beschrieben sindWir verwenden Ihre personenbezogenen Daten, um die bestmögliche Benutzererfahrung auf dieser Website zu ermöglichen, um den Zugriff auf Ihres Kontos und für andere Zwecke, die in unserem\r\n\r\n', '2021-12-16 12:31:45.732405'),
(594, 'first_aid_page', '', 0, 'First_Aid_Page_image_content', 'Finally there is an update for the dusty emergency helper course: the emergency helper course 2.0.\r\n\r\nDo you want to learn how to give first aid using the latest technology? Then you are exactly right here. Instead of a course booklet, we work with the smartphone and immerse ourselves in virtual reality, learn using 3D animations and work with digital exercises.\r\n\r\nWith us it means: use the smartphone and don\'t put it away!\r\n\r\nIf you are taking part in the course, please install the ucademy app «NHK 2.0» before the course begins.', 'Endlich kommt ein Update für den verstaubten Nothelferkurs: der Nothelferkurs 2.0.\r\n\r\nDu willst mit modernsten Technologien lernen, wie man Erste Hilfe leistet? Dann bist du hier genau richtig. Wir arbeiten anstelle eines Kurshefts mit dem Smartphone und tauchen ein in die virtuelle Realität, lernen mittels 3D-Animationen und arbeiten mit digitalen Übungen.\r\n\r\nBei uns heisst es: das Smartphone benutzen und nicht weglegen!\r\n\r\nWenn du am Kurs teilnimmst, bitte vor Kursbeginn die App «NHK 2.0» von ucademy installieren.', '2021-12-23 06:12:53.744202'),
