(675, 'term_and_condition', '', 0, 'term_and_condition_heading_title', 'Terms and Conditions - General Terms and Conditions', 'AGB - Allgemeine Geschäftsbedingungen', '2022-03-24 09:48:11.589818'),
(676, 'term_and_condition', '', 0, 'term_and_condition_title_1', 'Privacy:', 'Datenschutz:', '2022-03-24 09:48:11.592889'),
(677, 'term_and_condition', '', 0, 'term_and_condition_description_1', 'Photos taken during training or further education at Fahrschule Star GmbH may be used, published and passed on for your own advertising purposes. Fahrschule Star GmbH is entitled to store and use personal data and to pass them on to third parties who have been commissioned to process the data and are bound by strict confidentiality, as well as to use the data to develop new products and services.', 'Fotos, die während einer Aus- oder Weiterbildung der Fahrschule Star GmbH gemacht werden, dürfen für eigene Werbezwecke verwendet, veröffentlicht und weitergegeben werden. Die Fahrschule Star GmbH ist berechtigt Personaldaten aufzubewahren, zu verwenden und an Dritte, die für die Datenverarbeitung beauftragt wurden und an strikte Vertraulichkeit gebunden sind, weiterzugeben, sowie die Daten zur Entwicklung von neuen Produkten und Dienstleistungen zu verwenden.', '2022-03-24 09:48:11.594597'),
(678, 'term_and_condition', '', 0, 'term_and_condition_title_2', 'Links and Content', 'Links und Inhalte', '2022-03-24 09:48:11.595806'),
(679, 'term_and_condition', '', 0, 'term_and_condition_description_2', 'We have no influence on the content and design of linked pages and assume no liability for them.', 'Wir haben keinen Einfluss auf Inhalt und Gestaltung von verlinkten Seiten und übernehmen keine Haftung dafür.', '2022-03-24 09:48:11.597036'),
(680, 'term_and_condition', '', 0, 'term_and_condition_title_3', 'cookies', 'Kekse', '2022-03-24 09:48:11.598098'),
(681, 'term_and_condition', '', 0, 'term_and_condition_description_3', '\"This site uses cookies. Cookies are small text files that are stored permanently or temporarily on your computer when you visit this website. The purpose of the cookies is in particular to analyze the use of this website for statistical evaluation and for continuous improvements. You can completely or partially deactivate cookies in the settings of your browser at any time. If cookies are deactivated, you may no longer be able to use all the functions of this website.»', '«Diese Website verwendet Cookies. Cookies sind kleine Textdateien, die beim Besuch dieser Website in Ihrem Computer dauerhaft oder temporär gespeichert werden. Zweck der Cookies ist insbesondere die Analyse der Nutzung dieser Website zur statistischen Auswertung sowie für kontinuierliche Verbesserungen. In Ihrem Browser können Sie Cookies in den Einstellungen jederzeit ganz oder teilweise deaktivieren. Bei deaktivierten Cookies stehen Ihnen allenfalls nicht mehr alle Funktionen dieser Website zur Verfügung.»', '2022-03-22 11:19:31.818259'),
(682, 'term_and_condition', '', 0, 'term_and_condition_title_4', 'basics', 'Grundlagen', '2022-03-22 11:19:31.818259'),
(683, 'term_and_condition', '', 0, 'term_and_condition_description_4', 'The contract comes into effect upon registration (verbal, by telephone, WhatsApp, SMS or online) and ends automatically after passing the practical driving test. The STAR driving school undertakes to offer the learner drivers under the following conditions proper and proper training, which corresponds to the requirements of the Swiss Road Traffic Act for the admission of persons to road traffic.', 'Der Vertrag tritt bei Anmeldung (mündlich, telefonisch, WhatsApp, SMS oder online) in Kraft und endet automatisch nach bestandener praktischer Führerprüfung. Die Fahrschule STAR verpflichtet sich, den Fahrschülern unter den nachstehenden Bedingungen eine einwandfreie und ordnungsgemässe Ausbildung zu bieten, welche den Anforderungen des Schweizerischen Strassenverkehrsgesetzes für die Zulassung von Personen zum Strassenverkehr entspricht.', '2022-03-22 11:19:31.818259'),
(684, 'term_and_condition', '', 0, 'term_and_condition_title_5', 'goal', 'Ziel', '2022-03-22 11:19:31.818259'),
(685, 'term_and_condition', '', 0, 'term_and_condition_description_5', 'The aim is to obtain a driving license for category B (car) in accordance with the Swiss examination requirements for the theoretical and practical driving test of the Association of Road Traffic Authorities (ASA).', 'Ziel ist die Erlangung des Führerausweises für die Kategorie B (Auto), gemäss den Schweizerischen Prüfungsanforderungen für die theoretische und praktische Führerprüfung der Vereinigung der Strassenverkehrsämter (ASA).', '2022-03-22 11:19:31.818259'),
(686, 'term_and_condition', '', 0, 'term_and_condition_title_6', 'warranty', 'Gewährleistung', '2022-03-22 11:19:31.818259'),
(687, 'term_and_condition', '', 0, 'term_and_condition_description_6', 'The training driving instructor is in possession of the driving instructor license for issuing commercial driving lessons and will carry out the training in accordance with the latest methodological and didactic knowledge. The conclusion of the training contract does not guarantee that the driver\'s license will be obtained, especially if the learner driver wants to take the practical test too early.', 'Der ausbildende Fahrlehrer ist im Besitz des Fahrlehrerausweises zur Erteilung von gewerbsmässigem Fahrunterricht und wird die Ausbildung gemäss den neusten, methodisch-didaktischen Kenntnissen durchführen. Der Abschluss des Ausbildungsvertrages stellt keine Garantie für die Erlangung des Führerausweises dar insbesondere dann nicht, wenn der Fahrschüler von sich aus zu früh an die praktische Prüfung möchte.', '2022-03-22 11:19:31.818259'),
(688, 'term_and_condition', '', 0, 'term_and_condition_title_7', 'Practical driving test', 'Praktische Führerprüfung', '2022-03-22 11:19:31.818259'),
(689, 'term_and_condition', '', 0, 'term_and_condition_description_7', 'It is up to the driving instructor to register the student for the test. It decides whether someone is ready for the exam or not. The driving school Star takes the right to postpone or even cancel the test in case of doubt without prior agreement. At least two driving lessons are required for the practical driving test (at least three driving lessons are required for the practical driving test in the canton of Zurich). The first hour is used for preparation, \"running in\" and \"warming up\" for the test drive. The second hour is the practical test.', 'Es liegt in der Hand des Fahrlehrers den Schüler an die Prüfung anzumelden. Er entscheidet ob jemand Prüfungsreif ist oder nicht. Die Fahrschule Star nimmt sich das Recht die Prüfung, bei Zweifel, ohne Absprache zu Verschieben oder gar Abzusagen. Für die praktische Autofahrprüfung werden mindestens zwei Fahrlektionen benötigt (Für die praktische Autofahrprüfung im Kanton Zürich werden mindestens drei Fahrlektionen benötigt). Die erste Stunde dient zur Vorbereitung, zum „Einfahren“ und zum „Aufwärmen“für die Prüfungsfahrt. Die zweite Stunde ist die praktische Prüfung.', '2022-03-22 11:19:31.818259'),
(690, 'term_and_condition', '', 0, 'term_and_condition_title_8', 'vehicle', 'Fahrzeug', '2022-03-22 11:19:31.818259'),
(691, 'term_and_condition', '', 0, 'term_and_condition_description_8', 'The lessons for the practical driving lessons are given with a specially equipped driving school vehicle. In individual cases, a conventional vehicle may be used (service, breakdown, etc.). The tariff per lesson does not change as a result.', 'Die Lektionen für den praktischen Fahrunterricht werden mit einem dafür ausgerüsteten Fahrschulfahrzeug erteilt. In Einzelfällen kann es zum Einsatz eines herkömmlichen Fahrzeugs kommen (Service, Panne, etc.). Der Tarif pro Lektion verändert sich deswegen nicht.', '2022-03-22 11:19:31.818259'),
(692, 'term_and_condition', '', 0, 'term_and_condition_title_9', 'lesson duration', 'Lektionsdauer', '2022-03-22 11:19:31.818259'),
(693, 'term_and_condition', '', 0, 'term_and_condition_description_9', 'A driving lesson, also called a driving lesson for category B, lasts 45 minutes and a double lesson lasts 90 minutes and consists of: welcome, orientation, instructions, practical driving, final meeting and new appointment.', 'Eine Fahrstunde genannt auch Fahrlektion für die Kategorie B dauert 45 Minuten und eine Doppellektion dauert 90 Minuten und besteht aus: Begrüssung, Orientierung, Instruktionen, praktischem Fahren, Schlussbesprechung und neuer Terminfindung.', '2022-03-22 11:19:31.818259'),
(694, 'term_and_condition', '', 0, 'term_and_condition_title_10', 'cancellation', 'Annulierung', '2022-03-22 11:19:31.818259'),
(695, 'term_and_condition', '', 0, 'term_and_condition_description_10', 'Cancellations: Agreed driving lessons must be canceled at least 24 hours in advance, otherwise they will be charged. A cancellation via WhatsApp, SMS is only accepted if this is confirmed by us. This is because learner drivers have repeatedly sent messages to the wrong number or address. Late arrival or late cancellation of agreed appointments are at the expense of the learner driver. Regardless of the reason for the cancellation.', 'Absagen: Vereinbarte Fahrlektionen müssen mindestens 24 Stunden im Voraus abgemeldet werden, sonst werden sie verrechnet. Eine Absage per WhatsApp, SMS gilt erst akzeptiert wenn dies von uns bestätigt wird. Dies weil Fahrschüler immer wieder Nachrichten an eine falsche Nummer oder an eine falsche Adresse geschickt haben. Zu spätes Erscheinen oder eine nicht rechtzeitige Abmeldung von vereinbarten Terminen gehen zu Lasten des Fahrschülers. Unabhängig vom Grund der Absage.', '2022-03-22 11:19:31.818259'),
(696, 'term_and_condition', '', 0, 'term_and_condition_title_11', 'delay', 'Verspätung', '2022-03-22 11:19:31.818259'),
(697, 'term_and_condition', '', 0, 'term_and_condition_description_11', 'The driving instructor will wait a maximum of 15 minutes at the agreed meeting point. If the learner driver does not appear at the agreed meeting point by this time or if no agreement can be reached by telephone, the driving instructor can leave the agreed meeting point and the driving lessons will be charged as completed', 'Der/die Autofahrlehrer/in wartet beim vereinbarten Treffpunkt höchstens 15 Minuten. Erscheint der/die Fahrschüler/in bis zu diesem Zeitpunkt nicht beim vereinbarten Treffpunkt oder es kann telefonisch keine Einigung erzielt werden, kann der/die Autofahrlehrer/in sich vom vereinbarten Treffpunkt entfernen und die Autofahrlektionen werden als ausgeführt verrechnet', '2022-03-22 11:19:31.818259'),
(698, 'term_and_condition', '', 0, 'term_and_condition_title_12', 'Learner\'s permit and conditions', 'Lernfahrausweis und Auflagen', '2022-03-22 11:19:31.818259'),
(699, 'term_and_condition', '', 0, 'term_and_condition_description_12', 'The valid learner driver\'s license must be carried with you to every driving lesson and presented before the lesson. Without a valid learner\'s license, the lesson will be canceled with costs. Tight-fitting shoes and glasses/contact lenses are also mandatory, provided condition 01 is noted on the learner\'s permit.', 'Der gültige Lernfahrausweis ist zu jeder Fahrstunde mitzuführen und vor der Lektion vorzuweisen. Ohne gültigen Lernfahrausweis wird die Stunde mit Kostenfolge abgesagt. Ebenfalls zwingend sind fest schliessende Schuhe sowie Brille/Kontaktlinse sofern die Auflage 01 im Lernfahrausweis vermerkt ist.', '2022-03-22 11:19:31.818259'),
(700, 'term_and_condition', '', 0, 'term_and_condition_title_13', 'buses', 'Bussen', '2022-03-22 11:19:31.818259'),
(701, 'term_and_condition', '', 0, 'term_and_condition_description_13', 'Fines that are clearly caused by the fault of the learner driver are fully at the expense of the learner driver.', 'Bussen, die eindeutig durch das Verschulden des Fahrschülers verursacht werden, gehen vollumfänglich zu Lasten des Fahrschülers.', '2022-03-22 11:19:31.818259'),
(702, 'term_and_condition', '', 0, 'term_and_condition_title_14', 'Prices', 'Preise', '2022-03-22 11:19:31.818259'),
(703, 'term_and_condition', '', 0, 'term_and_condition_description_14', 'The prices can be viewed at any time on our website. We reserve the right to change these at any time and without notice.', 'Die Preise können jederzeit auf unserer Website eingesehen werden. Wir behalten uns das Recht vor, diese jederzeit und ohne Vorankündigung zu ändern.', '2022-03-22 11:19:31.818259'),
(704, 'term_and_condition', '', 0, 'term_and_condition_title_15', 'terms of payment', 'Zahlungsbedienungen', '2022-03-22 11:19:31.818259'),
(705, 'term_and_condition', '', 0, 'term_and_condition_description_15', 'Driving lessons and subscriptions must be paid for in cash or by bank transfer at the beginning of the lesson.', 'Fahrlektionen und Abonnemente sind jeweils bei Beginn der Lektion bar oder per Überweisung zu bezahlen.', '2022-03-22 11:19:31.818259'),
(706, 'term_and_condition', '', 0, 'term_and_condition_title_16', 'subscription', 'Abo', '2022-03-22 11:19:31.818259'),
(707, 'term_and_condition', '', 0, 'term_and_condition_description_16', 'Subscriptions are perks and will only be refunded if paid in cash and in advance. Driving lessons that have not been paid for in advance are considered individual lessons. Unredeemed driving lessons of a subscription after passing the driving test will be refunded to the learner driver. The unredeemed driving lessons are counted back to the next smaller subscription. Any carry over will be paid out. The validity of a subscription ends after 2 years.', 'Abonnemente sind Vergünstigungen und werden nur bei Bar- und Vorauszahlung erstattet. Fahrstunden, die nicht im Voraus bezahlt wurden, gelten als Einzellektionen. Nicht eingelöste Fahrstunden eines Abonnements nach bestandener Führerprüfung werden dem Fahrschüler zurückvergütet. Die nicht eingelösten Fahrstunden werden auf das nächst kleinere Abonnement zurückgerechnet. Der evtl. entstandene Übertrag wird ausbezahlt. Die Gültigkeit eines Abonnements endet nach 2 Jahren.', '2022-03-22 11:19:31.818259'),
(708, 'term_and_condition', '', 0, 'term_and_condition_title_17', 'Open invoices', 'Offene Rechnungen', '2022-03-22 11:19:31.818259'),
(709, 'term_and_condition', '', 0, 'term_and_condition_description_17', 'If driving lessons are not paid in full or if an invoice is not paid in full by the due date, the learner driver is automatically in default. An invoice must always be paid before the driving lessons to be taken. The learner driver bears all costs incurred by the STAR driving school as a result of the default in payment. No new driving lessons will be agreed until full payment has been made. An additional fee of CHF 10.00 will be charged for a reminder and an additional fee of CHF 50.00 for a threat of enforcement. A processing fee of CHF 150.00 will be charged in addition to the debt amount for a debt enforcement request. Should several driving lessons not have been paid towards the end of the training, these must be paid for by yourself at the latest on the day of the exam. Otherwise, the STAR driving school refuses to accompany you during the test. The resulting costs are at the expense of the learner driver.', 'Sollten Fahrstunden nicht vollumfänglich bezahlt werden oder sollte eine Rechnung nicht bis zum Fälligkeitsdatum vollumfänglich bezahlt werden, fällt die Fahrschülerin bzw. der Fahrschüler ohne weiteres in Verzug. Eine Rechnung ist immer vor den zu beziehenden Fahrstunden zu begleichen. Die Fahrschülerin bzw. der Fahrschüler trägt sämtliche Kosten, die der Fahrschule STAR durch den Zahlungsverzug entstehen. Bis zur vollständigen Bezahlung werden keine neuen Fahrlektionen vereinbart. Für eine Mahnung wird eine zusätzliche Gebühr von CHF 10.00 und für eine Betreibungsandrohung eine zusätzliche Gebühr von CHF 50.00 erhoben. Für ein Betreibungsbegehren werden eine Bearbeitungsgebühr von CHF 150.00 zusätzlich zum Schuldbetrag verrechnet. Sollten gegen Ende der Ausbildung mehrere Fahrstunden noch nicht bezahlt sein so sind dieses spätestens am Prüfungstag selber zu bezahlen. Ansonsten verweigert die Fahrschule STAR die Prüfungsbegleitung. Die daraus entstanden Kosten gehen zu Lasten des Fahrschülers.', '2022-03-22 11:19:31.818259'),
(710, 'term_and_condition', '', 0, 'term_and_condition_title_18', 'coupons', 'Gutscheine', '2022-03-22 11:19:31.818259'),
(711, 'term_and_condition', '', 0, 'term_and_condition_description_18', 'Vouchers can only be redeemed after successful receipt of payment. A refund is only possible as long as the voucher has not been redeemed. Cash payment or reimbursement of unused driving lessons is excluded. If you successfully pass practical tests with the STAR driving school, unused lessons will be refunded from the voucher.', 'Gutscheine sind erst einlösbar nach erfolgreichem Zahlungseingang. Eine Rückerstattung ist nur möglich solange der Gutschein nicht eingelöst wurde. Barauszahlung oder Rückerstattung nicht verbrauchter Fahrlektionen ist ausgeschlossen. Bei Erfolgreichen bestandener Praktischer Prüfungen mit der Fahrschule STAR, werden vom Gutschein nicht gebrauchte Lektionen erstattet.', '2022-03-22 11:19:31.818259'),
(712, 'term_and_condition', '', 0, 'term_and_condition_title_19', 'Administration and insurance fee', 'Administrations- und Versicherungsspauschale', '2022-03-22 11:19:31.818259'),
(713, 'term_and_condition', '', 0, 'term_and_condition_description_19', 'The administration fee is mandatory from the first driving lesson and must be paid in cash at the beginning of the training (even if you change driving schools). If a trial lesson has been agreed, the administration fee for the trial lesson is not due. This includes services that are provided outside of the actual driving lessons, such as training advice, exam registration, administration with authorities and costs for telephone calls, postage and IT. Furthermore, during the training lessons, the increased risk of liability, fully comprehensive vehicle insurance and passenger insurance is included in the insurance flat rate without a deductible. The administration fee is a one-off fee of CHF 100 and is only valid for the duration of the driving training at the STAR driving school.', 'Die Administrationspauschale ist ab der ersten Fahrstunde obligatorisch und bei Beginn der Ausbildung bar zu bezahlen (auch bei einem Fahrschulwechsel). Falls eine Probelektion vereinbart wurde ist die Administrationspauschale für die Probelektion nicht fällig. Darin erhalten sind Leistungen die ausserhalb des eigentlichen Fahrunterrichtes erbracht werden wie z.B. Ausbildungsberatung, Prüfungsanmeldung, Administration mit Ämtern sowie Kosten für Telefonate, Porto und Informatik. Weiter ist während den Ausbildungslektionen das erhöhte Risiko für Haftpflicht-, Fahrzeugvollkasko- und Insassenversicherung ohne Selbstbehalt in der Versicherungspauschale eingeschlossen. Die Administrationspauschale beträgt einmalig CHF 100.- und ist nur gültig für die Dauer der Autofahrausbildung bei der Fahrschule STAR.', '2022-03-22 11:19:31.818259'),
(714, 'term_and_condition', '', 0, 'term_and_condition_title_20', 'Exclusion from insurance coverage', 'Ausschluss aus dem Versicherungsschutz', '2022-03-22 11:19:31.818259'),
(715, 'term_and_condition', '', 0, 'term_and_condition_description_20', 'The insurance is only valid for trips with driving instructors from the STAR driving school. The insurance company reserves the right to make any warranty claims in the following cases: driving under the influence of alcohol, drugs, misuse of medication, fatigue and during motorcycle courses.', 'Die Versicherung gilt nur für Fahrten, bei Fahrlehrern der Fahrschule STAR dabei sind. Die Versicherung behält sich in den folgenden Fällen jede Gewährleistung vor: Fahren unter Alkohol, Drogen, Medikamenten Missbrauch, Übermüdung sowie bei Motorradkursen.', '2022-03-22 11:19:31.818259'),
(716, 'term_and_condition', '', 0, 'term_and_condition_title_21', 'Basic motorcycle course (MGK)', 'Motorradgrundkurs (MGK)', '2022-03-22 11:19:31.818259'),
(717, 'term_and_condition', '', 0, 'term_and_condition_description_21', 'The Star Driving School does not rent out motorcycles. The driving lessons and courses must be completed with your own motorcycle. Your own motorcycle must be in perfect technical condition (the tread depth of the tires must be at least 1.6mm). The motorcycle should be refueled. Motorcycle clothing should be available; (Motorcycle pants (if possible with protectors), motorcycle jacket (if possible with protectors), shoes (ankle-protecting, sturdy shoes), motorcycle gloves and a helmet. In bad weather, it is advantageous to bring a rain suit. In the event of damage or accidents during the training, the Driving school Star accepts no liability. The courses take place in all weather conditions. In bad weather (fog, snowfall, frost) the course will be canceled by the driving instructor. Basic course lasts 4 x 60 minutes (including a break)', 'Die Fahrschule Star vermietet keine Motorräder. Die Fahrlektionen und Kurse müssen mit dem eigenen Motorrad absolviert werden. Das eigene Motorrad muss in einem technisch einwandfreien Zustand sein (Die Profiltiefe der Reifen min. 1,6mm betragen). Das Motorrad sollte aufgetankt sein. Motorradbekleidung sollte vorhanden sein; (Motorradhosen(wenn möglich mit Protektoren), Motorradjacke(wenn möglich mit Protektoren), Schuhe (Knöchelschützendes, festes Schuhwerk), Motorradhandschuhe und dem Helm. Bei schlechtem Wetter ist das Mitbringen eines Regenkombis von Vorteil. Bei Schäden oder Unfällen während der Ausbildung übernimmt die Fahrschule Star keine Haftung. Die Kurse finden grundsätzlich bei jedem Wetter statt. Bei schlechtem Wetter (Nebel, Schneefall, Frost) erfolgt eine Absage des Kurses durch den Fahrlehrer. Grundkurs dauert 4 x 60 Minuten (inklusive Pause)', '2022-03-22 11:19:31.818259'),
(718, 'term_and_condition', '', 0, 'term_and_condition_title_22', 'Emergency helpers and traffic knowledge (VKU)', 'Nothelfer und Verkehrskunde (VKU)', '2022-03-22 11:19:31.818259'),
(719, 'term_and_condition', '', 0, 'term_and_condition_description_22', 'Driving school Star maintains cooperation with various organizations. You can find the general terms and conditions for the emergency helper courses and traffic knowledge lessons on the homepages of the relevant organization via the respective link on our homepage. The general terms and conditions of the respective driving schools are binding. Therefore, the Star driving school excludes any responsibility, liability or recourse for the first-aid courses and traffic lessons. In these cases, discrepancies must be clarified with the organization that conducts the lessons.', 'Die Fahrschule Star hält eine Zusammenarbeit mit verschiedenen Organisationen. Die Allgemeinen Geschäftsbedingungen für die Nothelferkurse und Verkehrskundeunterrichte finden sie, durch die jeweilige Verlinkung über unsere Homepage, auf den Homepages der entsprechenden Organisation. Die Allgemeinen Geschäftsbedingungen der jeweiligen Fahrschulen sind verbindlich. Daher schliesst die Fahrschule Star bei den Nothelferkursen und Verkehrskundeunterrichten jegliche Verantwortung, jegliche Haftung oder jeglichen Regressanspruch aus. Unstimmigkeiten sind in diesen Fällen mit der jeweils unterrichtsführenden Organisation zu klären.', '2022-03-22 11:19:31.818259'),
(720, 'term_and_condition', '', 0, 'term_and_condition_title_23', 'contractual relationship', 'Vertragsverhältnis', '2022-03-22 11:19:31.818259'),
(721, 'term_and_condition', '', 0, 'term_and_condition_description_23', 'The contractual relationship between the learner driver and the driving instructor can be terminated by either party at any time.', 'Das Vertragsverhältnis zwischen Fahrschüler und Fahrlehrer kann beidseits jederzeit aufgelöst werden.', '2022-03-22 11:19:31.818259'),
(722, 'term_and_condition', '', 0, 'term_and_condition_title_24', 'Payment method Purchase on account', 'Zahlungsart Kauf auf Rechnung', '2022-03-22 11:19:31.818259'),
(723, 'term_and_condition', '', 0, 'term_and_condition_description_24', 'When canceling a product that was made using the payment method purchase on account, the invoice costs remain at the expense of the customer. General terms and conditions for \"purchase on account\" The following costs are borne by the customer:\r\n\r\nInvoice fee: CHF 2.90 per invoice\r\n\r\nReminder fees in the event of non-payment within 30 days: payment reminder free of charge, second and third reminder CHF 25 each.\r\n\r\nFile assignment fee in case of collection: CHF 20.\r\n\r\nInterest on late payment: 10% per annum, from the due date of the invoice until full payment of the amount due', 'Bei Stornierung eines Produktes, die per Zahlungsart Kauf auf Rechnung getätigt wurden, bleiben die Rechnungskosten zu Lasten des Kunden. AGB für „Kauf auf Rechnung“ Folgende Kosten gehen zu Lasten des Kunden:\r\n\r\nRechnungsgebühr: CHF 2.90 pro Rechnung\r\n\r\nMahnungsgebühren im Falle einer Nicht-Bezahlung innert 30 Tage: Zahlungserinnerung kostenlos, zweite und dritte Mahnung je CHF 25.\r\n\r\nDossierabtretungsgebühr im Falle von Eintreibung: CHF 20.\r\n\r\nVerzugszinsen: 10% pro Jahr, ab Fälligkeitsdatum der Rechnung bis zur kompletten Zahlung des fälligen Betrags', '2022-03-22 11:19:31.818259'),
(724, 'term_and_condition', '', 0, 'term_and_condition_title_25', 'privacy', 'Datenschutz', '2022-03-22 11:19:31.818259'),
(725, 'term_and_condition', '', 0, 'term_and_condition_description_25', 'The STAR driving school undertakes to use the required personal data of the course participants exclusively for its own data processing and to only pass them on to authorized third parties who are also bound by strict confidentiality (e.g. road traffic office, accounting/fiduciary). Photographs and videos taken during driver training may be used for our website or other advertising purposes.', 'Die Fahrschule STAR verpflichtet sich, die benötigten Personaldaten der Kursteilnehmer ausschliesslich für die eigene Datenverarbeitung zu verwenden und diese nur an berechtigte Dritte weiterzuleiten, die ebenfalls an strikte Vertraulichkeit gebunden sind (z.B. Strassenverkehrsamt, Buchhaltung/Treuhand). Foto-und Videomaterial, die während der Fahrausbildung gemacht werden, dürfen für unsere Homepage oder andere eigenen Werbezwecke verwendet werden.', '2022-03-22 11:19:31.818259'),
(726, 'term_and_condition', '', 0, 'term_and_condition_title_26', 'business conditions', 'Geschäftsbedienungen', '2022-03-22 11:19:31.818259'),
(727, 'term_and_condition', '', 0, 'term_and_condition_description_26', 'The STAR driving school can change the general terms and conditions at any time.', 'Die Fahrschule STAR kann jederzeit die allgemeinen Geschäftsbedingungen ändern.', '2022-03-22 11:19:31.818259'),
(728, 'term_and_condition', '', 0, 'term_and_condition_title_27', 'place of jurisdiction', 'Gerichtsstand', '2022-03-22 11:19:31.818259'),
(729, 'term_and_condition', '', 0, 'term_and_condition_description_27', 'Swiss law applies. The place of jurisdiction is the seat of the driving school.', 'Es gilt Schweizer Recht. Gerichtsstand ist der Sitz der Fahrschule.', '2022-03-22 11:19:31.818259'),
(730, 'term_and_condition', '', 0, 'term_and_condition_title_28', 'Changes to these Terms and Conditions', 'Änderungen dieser AGB', '2022-03-22 11:19:31.818259'),
(731, 'term_and_condition', '', 0, 'term_and_condition_description_28', 'Driving school STAR reserves the right to change or supplement these terms and conditions for the future. Wettingen, December 22, 2021', 'Fahrschule STAR behält sich das Recht vor, diese AGB für die Zukunft zu ändern oder zu ergänzen. Wettingen, 22. Dezember 2021', '2022-03-22 11:19:31.818259'),
(732, 'Privacy_page', '', 0, '_change_Title_Privacy_', 'Privacy', 'Datenschutz', '2022-03-24 09:50:22.119293'),
(733, 'Privacy_page', '', 0, '_Privacy_desc_title_', 'Privacy ', 'Datenschutz', '2022-03-24 09:50:22.120912'),
(734, 'Privacy_page', '', 0, '_Privacy_Description_', 'Fotos, die während einer Aus- oder Weiterbildung der Fahrschule Star GmbH gemacht werden, dürfen für eigene Werbezwecke verwendet, veröffentlicht und weitergegeben werden. Die Fahrschule Star GmbH ist berechtigt Personaldaten aufzubewahren, zu verwenden und an Dritte, die für die Datenverarbeitung beauftragt wurden und an strikte Vertraulichkeit gebunden sind, weiterzugeben, sowie die Daten zur Entwicklung von neuen Produkten und Dienstleistungen zu verwenden. 1', 'Photos taken during training or further education at Fahrschule Star GmbH may be used, published and published for your own advertising purposes. Fahrschule Star GmbH is entitled to store, use and pass on personal data to third parties who have been commissioned to process the data and are bound by strict confidentiality, as well as to use the data to develop new products and services. ', '2022-03-24 09:50:22.122116'),
