(744, 'legal_page', '', 0, '_legal_page_description3_', 'We have no influence on the content and design of the linked pages and assume no liability for them. ', 'Wir haben keinen Einfluss auf Inhalt und Gestaltung der gelinkten Seiten und übernehmen keine Haftung dafür.', '2022-03-22 11:19:31.818259'),
(745, 'legal_page', '', 0, '_legal_page_title4_', 'Cookies ', 'Cookies', '2022-03-22 11:19:31.818259'),
(746, 'legal_page', '', 0, '_legal_page_description4_', '<p>«This website uses cookies. Cookies are small text files that are stored permanently or temporarily on your computer when you visit this website. The purpose of the cookies is in particular to analyze the use of this website for statistical evaluation and for continuous improvements. You can completely or partially deactivate cookies in the settings of your browser at any time. If cookies are deactivated, you may no longer be able to use all the functions of this website.»</p> ', '        <p>«Diese Website verwendet Cookies. Cookies sind kleine Textdateien, die beim Besuch dieser Website in Ihrem Computer dauerhaft oder temporär gespeichert werden. Zweck der Cookies ist insbesondere die Analyse der Nutzung dieser Website zur statistischen Auswertung sowie für kontinuierliche Verbesserungen. In Ihrem Browser können Sie Cookies in den Einstellungen jederzeit ganz oder teilweise deaktivieren. Bei deaktivierten Cookies stehen Ihnen allenfalls nicht mehr alle Funktionen dieser Website zur Verfügung.»</p>1\r\n', '2022-03-22 11:19:31.818259'),
