(757, 'about_us_page', '', 0, '_Team12_Title_', 'JOEL', 'JOEL', '2022-02-03 08:17:27.708228'),
(758, 'about_us_page', '', 0, '_Team12_description_', 'Joel, Furkan, ja wie denn nun?! Ach komm ... «Der Türke» war im früheren Leben Fitnessinstruktor. Jetzt nervt er hier rum und verkauft uns Proteinshakes und gesunde Sachen. Ich weiss nicht, was der will, aber das passt nicht zum Fahrlehrersein – wir sind faul und dick.', 'Joel, Furkan, ja wie denn nun?! Ach komm ... «Der Türke» war im früheren Leben Fitnessinstruktor. Jetzt nervt er hier rum und verkauft uns Proteinshakes und gesunde Sachen. Ich weiss nicht, was der will, aber das passt nicht zum Fahrlehrersein – wir sind faul und dick.', '2022-04-07 09:48:49.450711'),
