(18, 'Jana Selina Cocivera', 'jsco@bluewin.ch', '1999-09-30', '0786242716', '1', '1', '3', '1,2,3,4,5,6,7', 'Guten Tag! \r\n\r\nIch interessiere mich dafür, die Autoprüfung zu machen. Allerdings weiss ich nicht, was es alles dafür braucht und melde mich deswegen hier, um das Ganze möglicherweise einmal zu besprechen. \r\nAn einigen Tagen bin ich bereits am Nachmittag ', '1640179426'),
(19, 'Jamie George', 'david-george@gmx.ch', '2003-11-05', '0794466551', '2', '2', '1,2,3', '1,2,3,4,5,6,7', 'Ihr Lehrer Mige ist mir empfohlen worden.\r\nIch habe vom 27.12.2021 bis 9.1.2022 Betriebsferien und könnte jederzeit fahren,\r\n', '1640269378'),
(20, 'Goldanthas Navaradnasingam', 'goldanthas12@gmail.com', '1991-02-14', '+41 78 230 86 73', '1', '2', '2', '1,2,3,4,5', 'Guten Tag\r\n\r\nIch würde gerne ein 10er-Abo für Ratenzahlung abmachen. \r\n\r\nFreundliche Grüsse \r\n\r\nGoldanthas Navaradnasingam', '1640355985'),
(21, 'alida ', 'trionfinialida@gmail.com', '2002-07-04', '0768143355', '3', '1', '3', '1,2,4,5,6', 'Ich würde die Fahrstunden, gerne beim Mateen nehmen.', '1640549046'),
(22, 'Jessica Rego ', 'jessica.pt.j@gmail.com', '2003-07-21', '0762519950', '4', '2', '2,3', '1,2,3,4,5,6,7', ':)', '1640649415'),
(23, 'Bundhoo Yassin', 'ibu5417@yahoo.com', '2000-08-24', '+41787296801', '1', '2', '1,2,3', '6,7', 'Guten Tag\r\nich möchte Fahrstunde für meine Sohn Yassin buchen\r\nEr wohn in Untersiggenthal (5417) und kann bereits Auto fahren aber hast kein Führerschein .\r\nEr möchte die Führerschein Prüfung in Februar-Marz 2022 machen. Er möchte gern eine Probelektion d', '1640688082'),
(24, 'Joshua Lubach', 'jodo.lubach@gmail.com', '2000-09-19', '+41786931728', '2', '1', '2', '2,3', 'Also, ich habe den Motorradführerschein (9 November 21) und fahre jetzt schon seit geraumer Zeit mit dem L jeden Tag zur Schule (Navara Kingcab geschaltet), die einzige Frage die sich mir noch stellt ist; lohnt sich geschaltet für die Prüfung oder lieber ', '1640693611'),
(25, 'Ashley Ozorio Nuñez', 'ashley.ozorio@gmail.com', '1999-08-04', '0792417028', '2', '2', '2,3', '3,4,5', 'Fahrstunden bei Mateen.', '1640714794'),
