(29, 'Luisa Rohrbach', 'luisa04@gmx.ch', '2004-09-23', '+41765970004', '3', '2', '3', '1,2,3,4,5,6,7', 'Ich habe bis am 09.01.22 Ferien, bis dahin habe ich den ganzen Tag Zeit. Nach den Ferien, würde es am Mittwoch Morgen bis 9:30 Uhr gehen und am Wochenende den ganzen Tag.', '1640816593'),
(30, 'Aline Mullis', 'aline.mullis@gmail.com', '2002-08-20', '+41766046248', '3', '1', '2', '1,2,3,4,6,7', 'Die angegebenen Zeiten gelten für diese und nächste Woche da ich im Moment Ferien habe.\r\n\r\nFreundliche Grüsse\r\nAline Mullis', '1640877003'),
