(242, 'Sanja Savovic', 'luckysany@hotmail.com', '1990-01-11', '0798629223', '14', '4', '1,2,3', '1,2,3,5,6,7', 'Guten Abend\r\nIch möchte gerne die Prüfung für die Kategorie A absolvieren, besitze bereits eine Fahrerprüfung für ein Auto.\r\nIch würde gerne davor eine Probelektion bei euch absolvieren und wäre froh, wenn es klappen würde.\r\nGerne erwarte ich eine Rückmel', '1650133511'),
(243, 'Johna Rocreo', 'rocreojohna@outlook.com', '1990-06-24', '0774842961', '1', '2', '2,3', '6,7', 'Guten Tag, \r\n\r\nI would like to inquire about the driving lesson, I’ve been driving before and I got my full license from overseas, but unfortunately we are driving on the other side of the road (right hand side) thats why I would like to get a lessons, to', '1650180940'),
(244, 'Kim Heller', 'kim.heller@mail.ch', '2001-08-27', '0775243536', '3', '2', '1,2,3', '1,3,5,6', 'Hallo ich fahre seit 2 Jahren mit dem L herum. Mein Lehrfahrausweis läuft in 2 Monaten aus, wesshalb ich mich jetzt für die Prüfung anmelden muss und in den nächsten 2 Monaten Stunden brauche. Den VKU habe ich schon abgeschlossen. Ich fahre schon sicher u', '1650201166'),
(245, 'Leandro Guido', 'guido.leandro@bluewin.ch', '2004-06-08', '0765595430', '3', '2', '2,3', '2,4,5', 'Guten Abend\r\nZu den obigen Zeiten kann auch während der Schulzeit. In den Ferien hingegen kann ich von Mittwoch bis Freitag ab Vormittag. Zusätzlich hätte ich noch eine Bitte. Meine Eltern fahren einen Alpha Romeo Stelvio. Es wäre daher sehr praktisch für', '1650299350'),
(246, 'Eunice Ciccarese', 'nice.dp15@gmail.com', '1994-02-22', '763462892', '3', '2', '3', '6', 'Guten Morgen, \r\nIch bin Eunice Ciccarese. Ich möchte meinen Führerschein wiederholen. Ich könnte im Mai und den Wochenenden beginnen. \r\nWäre es möglich?\r\nFreundliche Grüsse \r\nEunice C.\r\n', '1650429636'),
