(286, 'Maram Chatila', 'maram.chatila@hotmail.com', '2003-01-21', '0763179727', '4', '2', '1,2,3', '1,2,3,4,5', 'Grüezi, mein Bruder hat mir diese Fahrschule empfohlen und er ist mit Frau Tettina Furkan mitgefahren. Wenn es möglich ist, möchte ich auch gerne Frau Tettina Furkan als Fahrlehrerin haben. Vielen Dank, Freundliche Grüsse Maram Chatila', '1652476923'),
(287, 'Charlotte Regan', 'regan.charlotte@gmail.com', '1988-12-27', '0765087318', '14', '1', '3', '1,2,3,4,5,6', 'Hallo\r\n\r\nIch würde gern eine erste Probelektion ausprobieren. Ich bin mir etwas unsicher, ob lieber automat oder mit Schaltung, aber habe erstmal geschaltet ausgewählt.\r\n\r\nVielen Dank und Grüsse\r\nCharlie', '1652522952'),
