(291, 'Aldis Jamini', 'aldisjaminii123@gmail.com', '1996-12-30', '0762250588', '3', '2', '2', '2,3,5', 'Guten Tag, \r\nich bin im August 2021 von Kosovo in die Schweiz gekommen. Am 20. Juni 2022 ist meine Prüfung für eine Kontrollfahrt. Kann ich ein paar (ca. 4-5?) Lektionen bei euch machen um mich vorzubereiten? Ich habe bereits 7 Jahre einen Führerausweis. ', '1652646710'),
(292, 'Vanessa Forest', 'vanessa_vieira92@hotmail.com', '1992-12-07', '0794287114', '14', '2', '3', '1,2,3,4,5,6', 'Guten Abend\r\nGerne möchte ich mich für die Fahrschule anmelden. Mein Lernfahrausweis ist nur bis 04.09.2022 gültig. Ich möchte gerne eine 20-er Abo machen, (das wäre ca. 2x Unterricht pro Woche),    damit ich mich gut und schnell  für die Prüfung vorberei', '1652721041'),
(293, 'Lukas', 'luk333sager@gmail.com', '2004-04-26', '0794521130', '3', '2', '3', '5', 'Das wird meine erste Fahrstunde. Ich bin aber schon oft privat gefahren.', '1652884431'),
