(299, 'Garcia Lopez Carmen', 'carmen.02.juli@gmail.com', '02.07.2001', '077433015', '2', '2', '1,3', '1,2,3,4,5', 'Da ich im Spital in Schichten arbeite, kann ich nicht kontinuierlich einen fixen Tag oder Uhrzeit angeben. Ich bin jedoch sehr flexibel und kann öfters auch mal unter der Woche oder an Randzeiten. Habe einfach mal einen Hacken gesetzt um dies abschicken z', '1653242448'),
