(391, 'Patrick Odermatt', 'patrick.o@hispeed.ch', '2004-09-09', '079 261 79 25', '3', '2', '1', '1', 'Guten Tag Liebe Damen und Herren\r\nIch würde gerne lernen Autofahren und habe mich deshalb für eine Probelektion angemeldet. Dies wäre das erste Mal, dass ich in einem Auto sitze, bis jetzt habe ich noch kein praktisches Vorkönnen. Ich würde mich freuen, w', '1662499882'),
