(404, 'Alina Barth', 'alina.barth@bluewin.ch', '2001-12-16', '079 535 30 90', '4', '2', '3', '1,2,3,4,5', 'Huhu\r\n\r\nFolgendes : Ich habe meine Theorieprüfung vor 2 Jahren gemacht.\r\nHabe danach auch 10 Fahrstunden genommen in denen ich jedoch leider nicht viel gelernt habe.\r\n\r\nNach diesen 10 Fahrstunden, habe ich aufgehört Unterricht zu nehmen.  Ich bin zwar pri', '1663158870'),
