(460, 'Emanuela Schilling', 'emanuelaschilling@gmail.com', '1997-04-09', '+41763846994', '4', '2', '3', '1,3', 'Hallo liebes Star-Team,\r\nLeider ist mir erst jetzt eingefallen, dass mein Lernfahrausweis (Kat. B)  nur noch bis zum 28.12.2022 gültig ist und es wäre natürlich super, wenn ich bis dann die Fahrprüfung erfolgreich ablegen könnte - ich weiss, es ist sehr a', '1667470060'),
(461, 'Anja Höfs ', 'ahhoefs@gmail.com', '1987-07-04', '0799300407', '3', '1', '1,2,3', '1,2,3,4,5,6', 'Guten Tag\r\nIch habe bereits den Führerausweis, aber bin seit mehr als 10 Jahren nicht Auto gefahren. Ich möchte wieder fahren, aber fühle mich nicht sicher, deshalb möchte ich ein paar Fahrstunden nehmen.\r\nFür eine erste Lektion würden mir folgende Termin', '1667482667'),
