(471, 'EMANUEL  TUTEK ', 'emanuel.tutek321@gmail.com', '2002-12-31', '0794389600', '3', '2', '1,2', '6', 'Guten Tag\r\nIch würde gern eine Probelektion haben. Ich bin wohnhaft in Otelfingen. \r\nTheorieprüfung bereits bestanden. Vku noch nicht angemeldet.\r\n\r\nKönnen Sie mich für eine Probelektion kontaktieren.\r\n\r\nFreundliche Grüsse\r\n\r\nEmanuel Tutek', '1668192029'),
(472, 'Imè Esenam', 'Imerosalyn@gmail.com', '2004-05-23', '+41765330523', '14', '2', '1,2,3', '6', 'Gerne würde ich eine Probelektion nachdem 23.November anfragn', '1668273080'),
(473, 'Palubska Patrycja', 'plesniak13@gmail.com', '1992-03-22', '0782823100', '3', '2', '3', '3', 'Hallo,\r\nDie beste Uhrzeit für mich ist ab 18:00 Uhr. Am Anfang will ich nur eine Stunde bestellen und dann können wir entscheiden wie viel Stunden brauche Ich. \r\n\r\nEin grüss', '1668423936'),
(474, 'Hasan Zhigolli', 'zhigollihasan@hotmail.com', '1995-10-27', '0793381712', '14', '2', '2,3', '1,2,3,4,5,6', 'Guten Tag, ich möchte die Fahrlektionen so schnell wie möglich und habe wenig Zeit. Ich habe einen Wochenplan und habe unterschiedliche Zeiten die ich arbeite.\r\n\r\nMit freundlichen Grüssen \r\n\r\nHasan Zhigolli', '1668527350'),
(475, 'Dorentina Avdylaga', 'avdylaga.d@gmail.com', '2005-01-18', '+41765665437', '14', '2', '3', '2,5', 'Hallo zusammen\r\nGerne würde ich bei euch meine Fahrstunden ablegen. Würde mich sehr für einen Termin freuen.\r\nVielen Dank!\r\nFreundliche Grüsse\r\nDorentina', '1668677759'),
