(129, 3, '_MIGE_Title_', 'MIGE', 'MIGE', '2021-09-08 04:45:23.357212'),
(130, 3, '_BlackPearl_Seas_Title_', 'With his BlackPearl he is currently conquering the streets instead of the seas. Mige has a lot of water (balloon) battles', 'Mit seiner Black Pearl erobert er im Moment die Strassen anstatt die Meere. Viele Wasser(ballon) schlachten hat Mige, sorry, Captain Mige schon hinter sich und hängt gerne seine Trophäen an die Wand (siehe Instagram).', '2021-09-06 10:28:05.532792'),
(131, 3, '_captain_Mige_Title_', 'behind him, sorry, Captain Mige and likes to hang his trophies on the wall (see Instagram).', '«Mige» Justiniano ist der Aargauer Superfahrlehrer – aber «streng und pingelig».', '2021-09-06 10:34:00.021432'),
(132, 3, '_GIANNI_Title_', 'GIANNI', 'GIANNI', '2021-09-06 10:28:57.463807'),
(133, 3, '_Dwayne_The_Rock_Johnson_Title', 'Our Dwayne the Rock Johnson could easily appear as a double in action films or as an MMA fighter. Although he looks', 'Unser Dwayne the Rock Johnson könnte ohne Weiteres als Double in Actionfilmen auftreten oder als MMA-Fighter durchgehen. ', '2021-09-06 10:29:12.444630'),
(134, 3, '_Grizzly_Bear_Title_', 'like a grizzly bear, he is \"only\" a teddy bear. He flexes his muscles in front of the expert and provides quick arguments why his students should pass the exam.', 'Obwohl er aussieht wie ein Grizzly-Bär ist er doch «nur» ein Teddybär. Seine Muskeln lässt er vor dem Experten spielen und bringt schlagfertige Argumente, warum seine Schüler die Prüfung bestehen sollten.', '2021-09-06 10:29:14.929379'),
(135, 3, '_FRANKY_Title_', 'FRANKY', 'FRANKY', '2021-09-06 10:29:19.970304'),
(136, 3, '_Frankydundee _lives_Title_', 'Frankydundee lives in the bush for a while, when he is not being bitten by snakes or hunted by crocodiles, he rides his', 'Frankydundee lebt einige Zeit im Busch. Wenn er dort nicht gerade von Schlangen gebissen oder von Krokodilen gejagt wird,', '2021-09-06 10:34:08.582040'),
(137, 3, '_Motorcycle_Drive_Title_', 'motorcycle through the wild Aargau or quickly drives his students through the test using adventurous examples.', 'reitet er auf seinem Motorrad durch den wilden Aargau oder bringt seine Autofahrschüler anhand abenteuerlicher Beispiele rasch durch die Prüfung.', '2021-09-06 10:34:13.849936'),
(138, 3, '_MATEEN_Title_', 'MATEEN', 'MATEEN', '2021-09-06 10:34:20.273644'),
(139, 3, '_around _the _football_Title_', 'In summer he runs around the football field in a pink outfit and in winter he grooms his beard, okay he actually does it all year round. When he is not busy with fitness or cosmetic products,', 'Im Sommer rennt er oft im rosaroten Outfit über den Fussballplatz, und im Winter pflegt er seinen Bart, okay, eigentlich macht er das das ganze Jahr. Wenn er nicht gerade im Fitness oder mit Kosmetikprodukten beschäftigt ist,', '2021-09-06 10:34:23.038426'),
(140, 3, '_Plans_Small_Attacks_Title_', 'he plans small attacks on his students and drives them with knives and machetes and a large portion of humor for testing.', 'plant er kleine Attentate auf seine Schüler und treibt sie mit Messer und Machete und einer grossen Portion Humor zur Prüfung.', '2021-09-06 10:34:28.295658'),
(141, 3, '_NIDI_Title_', 'NIDI', 'NIDI', '2021-09-06 10:34:31.393933'),
(143, 3, '_Nidi_Name_Title_', 'Yes, Nidi is his name, he doesn\'t even know how this name came about. In his old job he smelled a bit too much on the tires and the glue, otherwise we can\'t explain why he wants to become a driving instructor.', 'Ja, Nidi ist sein Name. Wie es zu diesem Namen kam, weiss nicht mal er selbst. In seinem alten Beruf hat er etwas zu viel an den Pneus und dem Kleber gerochen, ansonsten können wir es uns nicht erklären, warum er Fahrlehrer werden will.', '2021-09-06 10:34:37.035949'),
(144, 3, '_ANDREA_Title_', 'ANDREA', 'ANDREA', '2021-09-06 10:34:44.035937'),
(145, 3, '_Andrea_Electrifying_Title_', 'Andrea - The electrifying driving instructor No Andrea is not a woman, this name is also available for men - yes really, we couldn\'t believe it either.', 'Andrea – der elektrifizierende Fahrlehrer. Nein, Andrea ist keine Frau, diesen Namen gibt es auch für Männer – ja wirklich, wir konnten es auch nicht glauben. Früher war er als Elektriker unterwegs, dies erklärt auch seine «elektrifizierende» Art, bestimmt hat er schon den einen oder anderen Stromschlag zu viel bekommen. Da er etwas zu kurz ist für ein echtes Motorrad, fährt er gerne auf seinem Kinderbike auf Rennstrecken im Kreis, bis er nicht mehr weiss, wo oben und unten ist. Fazit: Mit etwas Strom fährt es sich besser.', '2021-09-06 10:34:49.130989'),
(146, 1, '_BAROL_Title_', 'BAROL', 'BAROL', '0000-00-00 00:00:00.000000'),
(147, 1, '_Birol_Ake_Barol_Title_', 'Birol aka Bärol - Berliner Bär driving instructor Zurich Conclusion: Strong as a driver to the driving license', 'Birol aka Bärol – Berliner-Bär-Fahrlehrer in Zürich. Fazit: Bärenstark.', '0000-00-00 00:00:00.000000'),
(148, 1, '_DESIREE_Title_', 'DESIREE', 'DESIREE', '0000-00-00 00:00:00.000000'),
(149, 1, '_Open_Collegial_Outgoing_Title_', 'I am an open, collegial and outgoing person. I have set up my courses so that we can work with a lot of fun so that time flies by.', 'Ich bin eine offene, kollegiale und aufgestellte Person. Ich habe meine Kurse so aufgebaut, dass wir mit viel Spass arbeiten können, damit die Zeit wie im Flug vergeht.', '0000-00-00 00:00:00.000000'),
(150, 1, '_MATEEN_Title_', 'MATEEN', 'MATEEN', '0000-00-00 00:00:00.000000'),
(151, 1, '_fitness_ cosmetic_ products_Title_', 'In summer he runs around the football field in a pink outfit and in winter he grooms his beard, okay he actually does it all year round. When he is not busy with fitness or cosmetic products,he plans small attacks on his students and drives them with knives and machetes and a large portion of humor for testing.', 'Im Sommer rennt er oft im rosaroten Outfit über den Fussballplatz, und im Winter pflegt er seinen Bart, okay, eigentlich macht er das das ganze Jahr. Wenn er nicht gerade im Fitness oder mit Kosmetikprodukten beschäftigt ist,', '2021-09-09 07:23:48.573285'),
