(184, 5, 'First _Aid _Course_Title_', 'First Aid Course', 'NOTHELFER', '0000-00-00 00:00:00.000000'),
(185, 5, '_First_Aid_Course_Aargau_Title_', 'First Aid Course In Aargau For Only 60.-', 'Nothelferkurs im Aargau für nur 60.–', '0000-00-00 00:00:00.000000'),
(186, 5, '_Study_Show_Over_title_', 'A study has shown that over 80% of the population is unable to provide correct first aid! Do you know how the side position works and when it is used? Or could you use the vital cardiac massage?', 'Eine Studie hat gezeigt, dass über 80 % der Bevölkerung nicht in der Lage ist, korrekte Erste Hilfe zu leisten! Weisst du, wie die Seitenlage funktioniert und wann diese angewendet wird? Oder könntest du die lebenswichtige Herzdruckmassage anwenden?', '2021-09-06 11:56:45.845564'),
(187, 5, '_Aid_course_prerequisite_title_', 'The first aid course is also a prerequisite for applying for a learning driving license.', 'Der Nothelferkurs ist zudem Voraussetzung, um einen Lernfahrausweis beantragen zu können.', '0000-00-00 00:00:00.000000'),
(188, 5, '_Nothelferkurs_Title_', 'Nothelferkurs 2.0 - Feedback Schüler', '[YouTube video «Nothelferkurs 2.0 – Feedback Schüler»]', '0000-00-00 00:00:00.000000'),
(189, 5, '_ dusty_ first_ aid_ course_Title_', 'Finally there is an update for the dusty first aid course: the first aid course 2.0.Do you want to learn how to provide emergency aid using the latest technologies?', 'Endlich kommt ein Update für den verstaubten Nothelferkurs: der Nothelferkurs 2.0.', '0000-00-00 00:00:00.000000'),
(190, 5, '_Exactly_right_title_', 'Then you are exactly right here. Instead of a course book, we work with the smartphone and dive into virtual reality, learn using 3D animations and work with digital exercises.', 'Du willst mit modernsten Technologien lernen, wie man Erste Hilfe leistet? Dann bist du hier genau richtig. Wir arbeiten anstelle eines Kurshefts mit dem Smartphone und tauchen ein in die virtuelle Realität, lernen mittels 3D-Animationen und arbeiten mit digitalen Übungen. Bei uns heisst es: das Smartphone benutzen und nicht weglegen!', '0000-00-00 00:00:00.000000'),
(191, 5, '_Important_Title_', ' Download the course material in the app after installation. The best way to do this is in the WLAN, since there is greater data usage. Also bring your', 'Wenn du am Kurs teilnimmst, bitte vor Kursbeginn die App «NHK 2.0» von ucademy installieren.', '2021-09-08 12:34:19.498513'),
(192, 5, '_Eadphones_title_', 'eadphones with you! If you have any problems or questions about the app, please contact : info@ucademy.ch', 'eadphones mit Ihnen! Wenn Sie Probleme oder Fragen zur App haben, wenden Sie sich bitte an: info@ucademy.ch', '2021-10-08 06:17:37.025063'),
(193, 5, '_Deine_Vorteile_Title_', 'Deine Vorteile:', 'Deine Vorteile:', '0000-00-00 00:00:00.000000'),
(194, 5, '_App_ anstatt_title_', 'App anstatt kursheft', 'App anstatt Kursheft', '0000-00-00 00:00:00.000000'),
(195, 5, '_virtual_reality_title_', 'Virtual Reality , Digitale Ubungen & mehr', 'Virtual Reality, digitale Übungen und mehr', '0000-00-00 00:00:00.000000'),
(196, 5, '_Higt_Score_Title_', 'Higt Score erreichen & preis gewinnen', 'Higt Score erreichen und Preis gewinnen', '0000-00-00 00:00:00.000000'),
