(201, 6, '_Traffic_Customer_Education_Title_', 'Traffic Customer Education (VKU) In The Baden Region', 'VKU in der Region Baden', '0000-00-00 00:00:00.000000'),
(202, 6, '_Traffic_Baden_Region_title_', 'Traffic in the Baden region is like sand at the sea. To spice up this dry lesson so that you can get the course behind you with a lot of fun in a short time, we have hired a specialist who is a real ace in the field of VKU.', 'Verkehrskunde in der Region Baden gibt es wie Sand am Meer. Um diesen trockenen Unterricht etwas aufzupeppen, damit du den Kurs mit viel Spass in kurzer Zeit hinter dich bringen kannst, haben wir extra einen Spezialisten engagiert, welcher im Bereich VKU ein richtiges Ass ist.', '0000-00-00 00:00:00.000000'),
(203, 6, '_Compulsory_Traffic_Science_Title_', 'The compulsory traffic science lessons (VKU) consist of 4 double lessons and can be attended to accompany the practical driving lessons. However,', 'Der obligatorische Verkehrskundeunterricht (VKU) besteht aus vier Doppellektionen und kann begleitend zum praktischen Fahrunterricht besucht werden. Es empfiehlt sich jedoch, den VKU möglichst früh zu besuchen, damit wichtige Informationen bei der praktischen Fahrausbildung angewendet werden können.', '0000-00-00 00:00:00.000000'),
(204, 6, '_Advisable_to_aTTend_title_', 'it is advisable to attend the VKU course as early as possible so that important information can be used in practical driver training.', 'es ist ratsam, den VKU-Kurs so früh zu besuchen ...', '2021-10-08 06:22:09.410858'),
(205, 6, '_Customer_Lessons_Title_', 'Traffic customer lessons (VKU) may only be attended with a valid learning driving license!', 'Der VKU darf nur mit einem gültigen Lernfahrausweis besucht werden.', '2021-09-07 09:31:07.126497'),
(206, 6, '_Legal_Reasons_Title_', 'For legal reasons, the double lessons must take place on four different days. Register now and benefit from our cheap course offers', 'Die Doppellektionen müssen aus gesetzlichen Gründen an vier verschiedenen Tagen stattfinden. Melde dich gleich an und profitiere von unseren günstigen Kursangeboten.', '0000-00-00 00:00:00.000000'),
