(227, 1, '_A (35 kW)_title_', 'A (35KW)', 'A (35 kW)', '0000-00-00 00:00:00.000000'),
(228, 1, '_einem_ Roller _/_ Motorrad _mit_Title_ ', '12 Stunden ab 18 Jahren Die Kursteilnahme ist nur mit einem gültigen Lernfahrausweis Kategorie A 35kW und einem Roller / Motorrad mit höchstens 35kW Leistung möglich!*', '12 Stunden ab 18 Jahren. Die Kursteilnahme ist nur mit einem gültigen Lernfahrausweis der Kategorie A 35 kW und einem Roller/Motorrad mit höchstens 35 kW Leistung möglich.*', '0000-00-00 00:00:00.000000'),
(229, 1, '_Aoffen_Title_', 'A (Open)', 'A (offen)', '0000-00-00 00:00:00.000000'),
(230, 1, '_category_ A _learning _driving _license_Title_', '12 hours from the age of 25 The course can only be attended with a valid category A learning driving license and a scooter / motorcycle with more than 11 kW power!*', '12 Stunden ab 25 Jahren. Die Kursteilnahme ist nur mit einem gültigen Lernfahrausweis der Kategorie A und einem Roller/Motorrad mit mehr als 11 kW Leistung möglich.*', '0000-00-00 00:00:00.000000'),
(231, 1, '_A1_From _18 _Years_title_', 'A1 - From 18 Years', 'A1 (ab 18 Jahren)', '0000-00-00 00:00:00.000000'),
(232, 1, '_Particpation_in_the_course_title_', 'Participation in the course is only possible with a valid category A1 learning driving license and a scooter / motorcycle with a maximum of 125 cm3 and 11 kW power!*', 'Die Kursteilnahme ist nur mit einem gültigen Lernfahrausweis der Kategorie A1 und einem Roller/Motorrad mit höchstens 50 cm3 möglich!*', '0000-00-00 00:00:00.000000'),
(233, 1, 'A1_ From_16 _Years_title_', 'A1 - From 16 Years', 'A1 (ab 16 Jahren)', '0000-00-00 00:00:00.000000'),
(234, 1, '_scooter_motorcycle _with_ a_ maximum_Title_', 'Participation in the course is only possible with a valid category A1 learning driving license and a scooter / motorcycle with a maximum of 50 cm3!*', 'Die Kursteilnahme ist nur mit einem gültigen Lernfahrausweis der Kategorie A1 und einem Roller/Motorrad mit höchstens 125 cm3 und 11 kW Leistung möglich.*', '0000-00-00 00:00:00.000000'),
(235, 1, '_back_title_', 'back', 'Zurück', '0000-00-00 00:00:00.000000'),
(236, 1, '_continue_Title_', 'continue', 'Weiter', '0000-00-00 00:00:00.000000'),
(237, 7, '_Motorycle_ Aarau_Title_', 'Motorcycle Course For The Region Of Aarau, Baden And Zurich', 'Motorradkurs in den Regionen Aarau, Baden, Winterthur und Zürich', '0000-00-00 00:00:00.000000'),
(238, 7, '_star_Driving_Title_', 'The Star driving school has established itself in the basic motorcycle course area for the regions of Aarau, Baden and Zurich and is the point of contact for an entertaining and interesting course. The courses are structured close to the exam and structured in an instructive manner. With a lot of fun and humor, the hours fly by.', 'Die Fahrschule Star hat sich im Bereich Motorradgrundkurs für die Regionen Aarau, Baden und Zürich etabliert und ist die Anlaufstelle für einen unterhaltsamen und interessanten Kurs. Die Kurse sind prüfungsnah aufgebaut und lehrreich gegliedert. Mit viel Spass und Humor vergehen die Stunden wie im Flug.', '2021-09-07 04:40:26.762180'),
(239, 7, '_Underestimate_Title_', 'Many underestimate the very high level that is required for the exam in Switzerland. The diarrhea rate last year was a whopping 56% !!', 'Viele unterschätzen das sehr hohe Niveau, welches in der Schweiz an der Prüfung gefragt ist. Im vergangenen Jahr betrug die Durchfallsquote sagenhafte 56 %!', '0000-00-00 00:00:00.000000'),
(240, 7, '_ practice_ the _course_ goals_Title_', 'We have set up our basic motorcycle course in such a way that practically no driving lessons are required (provided you reach and practice the course goals). A test drive lesson gives a feeling of what it will be like during the test and serves as a location assessment.', 'Wir haben unseren Motorradgrundkurs so aufgebaut, dass man praktisch keine Fahrstunden mehr benötigt (sofern man die Kursziele erreicht und übt). Eine Prüfungsfahrtlektion gibt ein Gefühl, wie es an der Prüfung sein wird, und dient als Standortbestimmung.', '0000-00-00 00:00:00.000000'),
(241, 7, '_Motorbike_trial_course_title_', 'Motorbike Trial Course', 'Motorrad-Schnupperkurs', '0000-00-00 00:00:00.000000'),
(242, 7, '_mptprcycling_title_', 'Motorcycling is not just a way to get around, it is passion and embodies a feeling of freedom.', 'Motorradfahren ist nicht nur eine Art, um sich fortzubewegen, es ist Leidenschaft und verkörpert ein Gefühl von Freiheit.', '0000-00-00 00:00:00.000000'),
(243, 7, '_ability _to_ move_title_', 'In this course we show you the first steps and impart the necessary know-how and the ability to move a motorcycle.', 'In diesem Kurs zeigen wir dir die ersten Schritte und vermitteln das nötige Know-how und die Fähigkeit, ein Motorrad zu bewegen.', '2021-09-06 18:26:38.848396'),
(244, 7, '_Combine_Theory_Title_', 'With a lot of humor we combine theory with practice in such a way that you would like to keep going all day long.', 'Mit viel Humor kombinieren wir die Theorie mit der Praxis so, dass du am liebsten noch den ganzen Tag weitermachen möchtest.', '0000-00-00 00:00:00.000000'),
(245, 7, '_Basic_motorcycle_Title_', 'Basic Motorcycle Courses', 'Motorrad-Grundkurse', '0000-00-00 00:00:00.000000'),
(246, 7, '_Motorcycle_Training_Title_', 'Motorcycle Curve Training', 'Motorrad-Kurventraining', '0000-00-00 00:00:00.000000'),
(247, 7, '_Cornering_Right_Tehcnology_title_', 'Cornering is the most beautiful thing about motorcycling. With the right technology, safety, fun and joy increase. We practice that on this daily course. We learn to consciously', 'Kurvenfahren ist das Schönste beim Motorradfahren. Mit der richtigen Technik erhöht sich die Sicherheit, der Spass und die Freude. Das üben wir an diesem Tageskurs. Wir lehren, die Kurven bewusst zu realisieren und diese auf einer sicheren Linie zu durchfahren. Ziel ist, Kurven möglichst rund und dynamisch zu fahren.', '0000-00-00 00:00:00.000000'),
(248, 7, '_implement_curves_drive_Title_', 'implement the curves and to drive them on a safe line. The goal is to make curves as round and dynamic as possible.', 'Mit Hightech und Know-how zeigen wir dir auf, wie schön Kurvenfahren sein kann.', '0000-00-00 00:00:00.000000'),
(249, 7, '_high_tech_and_know_how_ttile_', 'With high-tech and know-how, we show you how beautiful cornering can be.', 'Mit Hightech und Know-how zeigen wir Ihnen, wie schön...', '2021-10-08 06:23:57.455175'),
(250, 7, '_Test_requirments_title_', 'Motorcycle Test Requirements', 'Anforderungen Motorradprüfung', '0000-00-00 00:00:00.000000'),
(251, 7, '_Clothing_title_', 'Clothing', 'Bekleidung', '0000-00-00 00:00:00.000000'),
(252, 7, '_Category_A1_Title_', 'Category A1', 'Kategorie A1', '0000-00-00 00:00:00.000000'),
(253, 7, '_Motorcycle_helmet_Title_', 'Motorcycle helmet (tested according to ECE regulation 22)', 'Motorradhelm (geprüft nach ECE-Reglement 22)', '0000-00-00 00:00:00.000000'),
(254, 7, '_Motorcycle_gloves_Title_', 'Motorcycle gloves or gloves made from abrasion and tear-resistant material', 'Motorradhandschuhe oder Handschuhe aus abrieb- und reissfestem Material', '0000-00-00 00:00:00.000000'),
(255, 7, '_robist_Jacket_trousers_title_', 'Robust jacket and trousers made of abrasion and tear resistant material', 'Robuste Jacke und Hose aus abrieb- und reissfestem Material', '0000-00-00 00:00:00.000000'),
(256, 7, '_Motorbike_boots_ankle_title_', 'Motorbike boots or ankle-protecting, sturdy shoes', 'Motorradstiefel oder knöchelschützendes, festes Schuhwerk', '0000-00-00 00:00:00.000000'),
(257, 7, '_Protective_requirement_title_', 'The protective requirements for clothing must also be met when wearing rainwear.', 'Die Schutzanforderungen an die Bekleidung müssen auch beim Tragen der Regenbekleidung erfüllt sein.', '0000-00-00 00:00:00.000000'),
(258, 7, '_Category_A_A_Limited_Title_', 'Category A And A Limited (35KW)', 'Kategorie A und A beschränkt (35 kW)', '0000-00-00 00:00:00.000000'),
(259, 7, '_Moto_gloves_title_', 'Motorcycle gloves', 'Motorradhandschuhe', '0000-00-00 00:00:00.000000'),
(260, 7, '_jacket_title_', 'Motorcycle jacket', 'Motorradjacke', '0000-00-00 00:00:00.000000'),
(261, 7, '_pants_title_', 'Motorcycle pants', 'Motorradhose', '0000-00-00 00:00:00.000000'),
(262, 7, '_Vehicle_cat_title_', 'Vehicle Cat. A Limited (35kw)', 'Fahrzeug Kat. A beschränkt (35 kW)', '0000-00-00 00:00:00.000000'),
(263, 7, 'A-2_wheeled_title_', 'A 2-wheeled, 2-seater motorcycle without a sidecar with an engine power of at most 35 kW and a ratio of engine power and unladen weight of not more than 0.20 kW / kg. No motorcycle in subcategory A1.', 'Ein zweirädriges, zweiplätziges Motorrad ohne Seitenwagen mit einer Motorleistung von höchstens 35 kW und einem Verhältnis von Motorleistung und Leergewicht von nicht mehr als 0,20 kW/kg. Kein Motorrad der Unterkategorie A1.', '0000-00-00 00:00:00.000000'),
(264, 7, '_vehicle_category_A1_title_', 'Vehicle Category A1', 'Fahrzeug Kat. A1', '0000-00-00 00:00:00.000000'),
(265, 7, '_two_wheel_motorcycle_title_', 'A two-wheel motorcycle without a sidecar with a maximum displacement of 125 cm3 and an engine output of maximum 11 kW. (For handlebars 18 years at most 50 cm3). ', 'Ein zweirädriges Motorrad ohne Seitenwagen mit einem Hubraum von höchstens 125 cm3 und einer Motorleistung von höchstens 11 kW. Für Lenker unter 16 Jahren höchstens 50 cm3 und max. 4 kW. Nach vollendetem 16. Lebensjahr ist man automatisch dazu berechtigt, ein Motorrad mit einem Hubraum von max. 125 cm3 und max. 11 kW zu führen.', '0000-00-00 00:00:00.000000'),
(266, 7, '_vehicle_maximum_speed_title_', 'If a test vehicle with a maximum speed of 45 km / h is used, the category A1 is limited to 45 km / h.', '', '0000-00-00 00:00:00.000000'),
(267, 7, '_ehicle_cat_title_', 'ehicle Cat. A', 'Fahrzeug Kat. A', '0000-00-00 00:00:00.000000'),
(268, 7, '_motorcycle_sidecar_title_', 'A motorcycle without a sidecar with an engine output of at least 35 kW and two seats.', 'Ein Motorrad ohne Seitenwagen mit einer Motorleistung von mindestens 35 kW, zwei Sitzplätzen und einem Verhältnis von Motorleistung und Leergewicht von mehr als 0,20 kW/kg.', '0000-00-00 00:00:00.000000'),
(269, 7, '_Rent_motorcycle_title_', 'Rent A Motorcycle?', 'Motorrad mieten?', '0000-00-00 00:00:00.000000'),
(270, 7, '_own_motorcycle_yet_title_', 'You don\'t have your own motorcycle yet? Would you like to rent one for the course or even buy one later? Get in touch with our partner Hauptlin . He will provide a suitable motorcycle.', 'Du besitzt noch kein eigenes Motorrad? Du möchtest für den Kurs eines mieten oder später sogar eines kaufen? Melde dich bei unserem Partner Hauptlin [link to https://www.hauptlin.ch/de/index.html]. Er wird dir ein passendes Motorrad bereitstellen.', '0000-00-00 00:00:00.000000'),
(271, 7, '_reservation_request_title_', 'For a reservation request, please contact Hauptlin directly: info@hauptlin.ch If you definitely decide to rent a motorcycle, you declare that you agree to the General Terms and Conditions of Hauptlin.', 'Für eine Reservationsanfrage direkt an Hauptlin wenden: info@hauptlin.ch [mail to info@hauptlin.ch] \r\nWenn du dich definitiv entscheidest, ein Motorrad zu mieten, erklärst du dich mit den AGB [link to https://cdn.fahrschule-star.ch/wp-content/uploads/2018/01/Allgemeine-Vertragsbestimmungen-Miete-Fahrzeug.pdf -> tbd] von Hauptlin einverstanden.', '0000-00-00 00:00:00.000000'),
(272, 7, '_boo_motorcycle_course_title_', 'Book A Motorcycle Course Now!', 'Jetzt Termine für den Motorradgrundkurs buchen', '0000-00-00 00:00:00.000000'),
(273, 7, '_esaily_book_motorcycle_course_title_', 'You can easily book the motorcycle course of your choice online.', 'Buche deine Termine für den Motorradgrundkurs bequem online.', '0000-00-00 00:00:00.000000'),
(274, 8, '_Pricing_Plan_title_', 'Pricing Plan', 'PREISE', '0000-00-00 00:00:00.000000'),
(276, 8, '_pay_comfortably_title_', 'Pay Comfortably In Installments For All Driving Hours', 'Alle Fahrstunden bequem in Raten bezahlen', '0000-00-00 00:00:00.000000'),
(277, 8, '_ almost_mandatory_title_', 'In today\'s era of mobility, it is almost mandatory to take the car test. On the way to acquiring the driver\'s license you have to overcome a few hurdles such as  the financial investment for driving lessons, theory testing, traffic studies and driving courses.', 'In der heutigen Zeit der Mobilität ist es beinahe Pflicht, die Autoprüfung abzulegen. Auf dem Weg zum Erwerb des Führerausweises muss man aber einige Hürden bewältigen wie die finanzielle Investition in Fahrstunden, Theorieprüfung, Verkehrskunde und Fahrkurse.', '2021-09-07 05:57:38.532644'),
(278, 8, '_financial_situation_title_', 'The financial situation poses problems for many young people. The professional and private pressure to pass the exam as quickly as possible and the lack of financial resources are a major obstacle. Studies have shown that, on average, you need a few hours more driving if you attend the driving school at irregular intervals.', 'the lack of financial resources are a major obstacle. Studies have shown that, on average, you need a few hours more driving if you attend the driving school at irregular intervals.the lack of financial resources are a major obstacle. Studies have shown that, on average, you need a few hours more driving if you attend the driving school at irregular intervals.', '0000-00-00 00:00:00.000000'),
(279, 8, '_offer_fair_title_', 'We offer a fair and customer-oriented solution to this problem - purchase on installments.', 'Wir bieten für diese Problematik eine faire und kundenorientierte Lösung: den Kauf auf Raten. ', '0000-00-00 00:00:00.000000'),
(280, 8, 'Request_driving_lessons_online_title_ ', 'Request driving lessons online and step on the gas. We will help you to pass the exam as soon as possible. You can only concentrate on driving and don\'t have to worry about the financial means. We shoot you the money and you pay back the amount comfortably in installments (up to 12 months). You do NOT have to sign a contract or anything like that.The only thing you have to do is choose a package online, add it to the shopping cart, select installment purchase, register and you\'re done. (positive credit check required)', 'Buche online Fahrstunden und gib Gas. Wir helfen dir, so rasch wie möglich die Prüfung zu bestehen. Dabei kannst du dich nur auf das Fahren konzentrieren und brauchst dir keine Sorgen um die finanziellen Mittel zu machen. Wir schiessen dir das Geld vor, und du bezahlst bequem in Raten (innerhalb zwölf Monaten) den Betrag zurück. Dabei musst du keinen Vertrag oder derartiges unterzeichnen. Das Einzige, was du tun musst, ist online ein Paket wählen, in den Warenkorb legen, Ratenkauf anwählen, anmelden und fertig (positive Bonitätsprüfung wird vorausgesetzt).', '2021-09-07 06:12:56.186503'),
(281, 8, '_Lesson_prices_title_', 'The lesson prices for paying in installments for the machine and the manually switched car are CHF 89 .- / lesson and in a 10-person subscription CHF 890.-', 'Die Lektionspreise für die Ratenzahloption betragen für die Autofahrausbildung (Schaltung oder Automat) CHF 89.– pro Lektion und im 10er-Abo CHF 890.–.', '0000-00-00 00:00:00.000000'),
