(357, 5, 'We_offer_the_first_aid_title_ ', 'We offer the first aid course (NHK) in the Baden region at an affordable price. For only 60.- (including ID) you learn first aid, which is mandatory for the acquisition of a driver\'s license.', 'Den Nothelferkurs (NHK) bieten wir in der Region Baden zu einem günstigen Preis an. Für nur CHF 60.– (inklusive Ausweis) erlernt man die erste Hilfe, welche für den Erwerb eines Führerausweises obligatorisch ist.', '0000-00-00 00:00:00.000000'),
(358, 5, '_learn_how_to_provide_title_', 'Do you want to learn how to provide emergency aid using the latest technologies? Then you are exactly right here. Instead of a course book, we work with the smartphone and dive into virtual reality, learn using\r\n								3D animations and work with digital exercises.', 'Eine Studie hat gezeigt, dass über 80 % der Bevölkerung nicht in der Lage ist, korrekte Erste Hilfe zu leisten! Weisst du, wie die Seitenlage funktioniert und wann diese angewendet wird? Oder könntest du die lebenswichtige Herzdruckmassage anwenden?', '0000-00-00 00:00:00.000000'),
(359, 5, '_we_Say_title_', 'We say: use your smartphone and don\'t put it away!', 'Bei uns heisst es: das Smartphone benutzen und nicht weglegen!', '0000-00-00 00:00:00.000000'),
(360, 5, '_if_you_taking_course_title_', 'If you are taking part in the course, please install the ucademy “NHK 2.0” app before the start of the course\r\n', 'Wenn du am Kurs teilnimmst, bitte vor Kursbeginn die App «NHK 2.0» von ucademy installieren.', '0000-00-00 00:00:00.000000'),
(361, 5, '_easily_online_title_', 'You can easily book your first aid course online', 'Jetzt Termin für den Nothelferkurs buchen', '0000-00-00 00:00:00.000000');
INSERT INTO `translations` (`id`, `pageid`, `alias`, `inenglish`, `ingerman`, `created`) VALUES
(363, 6, '_traffic_vku_title_', 'Traffic Studies (VKU)', 'VERKEHR SKUNDEUNTERRICHT (VKU)', '2021-09-08 13:35:24.834367'),
(364, 7, '_in_categories_title_', 'In categories A1 and A, you must complete the practical basic course within four months of the date of issue of the learning driving license. It is 8 hours for category A1 and 12 hours for category A.', 'Bei den Kategorien A1 und A beschränkt ist innerhalb von vier Monaten ab Ausstellungsdatum des Lernfahrausweises der praktische Grundkurs zu absolvieren. Es sind seit dem 1. Januar 2021 für alle Kategorien zwölf Stunden in jeweils drei Teilen à vier Stunden zu besuchen.', '0000-00-00 00:00:00.000000'),
(365, 7, '_with_learning_title_', 'With a category A learning driving license, you may not complete the basic training with a category A1 vehicle.', 'Mit einem Lernfahrausweis der Kategorie A beschränkt darf man die Grundschulung nicht mit einem Fahrzeug der Kategorie A1 absolvieren.', '0000-00-00 00:00:00.000000'),
(366, 7, '_ankle_protecting_title_', 'Motorradstiefel oder knöchelschützendes festes Schuhwerk', 'Motorbike boots or ankle-protecting sturdy shoes', '0000-00-00 00:00:00.000000'),
