(376, 7, '_select_title_', ' Select All', 'Alle auswählen', '0000-00-00 00:00:00.000000'),
(377, 7, '_protective_requirements_for_title_', 'The protective requirements for clothing must also be met when wearing rainwear', 'Auch beim Tragen von Regenbekleidung sind die Schutzanforderungen an die Kleidung einzuhalten', '0000-00-00 00:00:00.000000'),
(378, 8, '_Traffic_in_the_Baden_title_', 'Traffic in the Baden region is like sand at the sea. To spice up this dry lesson so that you can get the course behind you with a lot of fun in a short time, we have hired a specialist who is a real ace in the field of VKU.', 'Verkehrskunde (VKU) in der Region Baden gibt es wie Sand am Meer. Um diesen trockenen Unterricht etwas aufzupeppen, damit du den Kurs mit viel Spass in kurzer Zeit hinter dich bringen kannst, haben wir extra einen Spezialisten engagiert, welcher im Bereich VKU ein richtiges Ass ist.', '0000-00-00 00:00:00.000000'),
(379, 8, 'drive_today_pay_title_', 'Drive today - pay tomorrow', 'Heute fahren - morgen bezahlen', '0000-00-00 00:00:00.000000'),
(380, 8, '_we_ooffer_first_title_', 'We offer the first aid course (NHK) in the Baden region at an affordable price. For only 60.- (including ID) you learn first aid, which is mandatory for the acquisition of a driver\'s license', 'Den Nothelferkurs (NHK) bieten wir in der Region Baden zu einem günstigen Preis an. Für nur CHF 60.– (inklusive Ausweis) erlernt man die Erste Hilfe, welche für den Erwerb eines Führerausweises obligatorisch ist.', '0000-00-00 00:00:00.000000'),
