(389, 2, '_Ducati_', 'Ducati Partner', 'Ducati Partner', '0000-00-00 00:00:00.000000'),
(390, 2, '_As_An_Official_Ducati_Partner_', 'As An Official Ducati Partner, We Guarantee The Highest ', 'Als offizieller Ducati Partner garantieren wir höchste', '0000-00-00 00:00:00.000000'),
(391, 2, ' _History_Of_Ducati_', 'The History Of Ducati\r\n', 'Die Geschichte von Ducati', '0000-00-00 00:00:00.000000'),
(392, 2, '_borgo_panigale_', 'Borgo Panigale, once a settlement of farms and tenants\' houses, is now located in a district in western Bologna. It became known with the founding of the brothers Adriano, Bruno and Marcello Cavalieri Ducati in 1935.\r\n\r\n', 'Borgo Panigale, einst eine Siedlung von Bauernhöfen und Pächterhäusern, befindet sich heute in einem Stadtteil im Westen von Bologna. Bekannt wurde es mit der Gründung der Brüder Adriano, Bruno und Marcello Cavalieri Ducati im Jahr 1935.\r\n\r\n', '0000-00-00 00:00:00.000000'),
(393, 2, '_massive_work_', 'Since 1946 the massive work has been considered the \"cradle\" of the Reds from Borgo Panigale. However, the origins of the Ducati are not to be found in Borgo Panigale.\r\n\r\n', 'Seit 1946 gilt das gewaltige Werk als \"Wiege\" der Roten aus Borgo Panigale. Die Ursprünge der Ducati sind jedoch nicht in Borgo Panigale zu finden.', '0000-00-00 00:00:00.000000'),
(394, 2, '_not_many_know_', 'Not many know that Ducati was initially based in the middle of Bologna. Società Scientifica Radio Brevetti Ducati (the company\'s original name) was founded on July 4, 1926 and the company\'s headquarters were in the middle of Bologna\'s old town, at Via Collegio di Spagna 9, where it was adjacent to the institute of the same name.', 'Nicht viele wissen, dass Ducati ursprünglich mitten in Bologna ansässig war. Società Scientifica Radio Brevetti Ducati (der ursprüngliche Name des Unternehmens) wurde am 4. Juli 1926 gegründet und der Hauptsitz des Unternehmens befand sich mitten in der Altstadt von Bologna, in der Via Collegio di Spagna 9, wo es an das gleichnamige Institut angrenzt.\r\n', '0000-00-00 00:00:00.000000'),
(395, 2, '_at_that_time_', 'At that time, the three brothers rented three rooms on the ground floor in which they started their work. The actual work was in the basement of the villa owned by the Ducati family at Viale Guidotti 51.', 'Damals mieteten die drei Brüder drei Räume im Erdgeschoss, in denen sie ihre Arbeit begannen. Die eigentliche Arbeit fand im Keller der Villa der Familie Ducati in der Viale Guidotti 51.', '0000-00-00 00:00:00.000000'),
(396, 2, '_instructors_for_', 'The driving instructors for Ducati drivers', 'Die Fahrlehrer für Ducati-Fahrer', '0000-00-00 00:00:00.000000'),
(397, 2, '_school_partner_', 'Being an official driving school partner of Ducati means responsibility and quality standards. We are competent driving instructors, both pedagogically and professionally.', 'Offizieller Fahrschulpartner von Ducati zu sein, bedeutet Verantwortung und Qualitätsstandards. Wir sind kompetente Fahrlehrer, sowohl pädagogisch als auch fachlich.', '0000-00-00 00:00:00.000000'),
(398, 2, '_we_hope_', 'We hope you enjoy driving!', 'Wir wünschen Ihnen viel Spaß beim Fahren!', '0000-00-00 00:00:00.000000'),
